ustralia. Le prospettive di crescita nel mercato estero prospettano la necessit&agrave; di produrre maggiori volumi, viene cos&igrave; inaugurato nel 2007 un nuovo edificio interamente dedicato alla produzione di beta lattamici.</p>\r\n\r\n<p>Nel 2006 Ibi avverte la necessit&agrave; di adeguare la propria organizzazione ad una dimensione europea per rispondere in modo adeguato all&rsquo;affermarsi delle aziende specializzate nei farmaci equivalenti. Insieme ad un noto gruppo europeo viene fondata la Ibisqus, dedicata alla commercializzazione in ospedale in UK, Italia e Germania.</p>\r\n\r\n<p>Anche nel presente la IBI persegue la vocazione di continuare a rappresentare una moderna e creativa realt&agrave; nel panorama farmaceutico nazionale. Non si ferma davanti agli scenari in continuo movimento e neanche di fronte alle nuove tecnologie facendole proprie. In questa prospettiva di sviluppo la IBI si &egrave; affiancata al mondo della Nanomedicina che si sta sempre pi&ugrave; affermando. Ha rinnovato il proprio Know How ed i laboratori ed &egrave; pronta per nuove sfide per offrire strumenti e prodotti in linea con la missione iniziale del suo fondatore &ldquo;fare per dare&rdquo; al fine di migliorare la qualit&agrave; della vita.</p>\r\n', 'en'),
(17, 9, '<h2>IBI: Codice Etico</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p>IBI adottando il presente Codice Etico esprime il convincimento che il rispetto dei principi qui contenuti sia il primo fattore di successo per la conduzione degli affari e delle attivit&agrave; aziendali. Esprime inoltre la volont&agrave; di operare affinch&eacute; il primario obiettivo aziendale sia quello di soddisfare le necessit&agrave; e le aspettative degli interlocutori di IBI.</p>\r\n\r\n<p><strong>Valori ed Obiettivi</strong><br />\r\nIBI pone alla base del proprio operato aziendale i valori dell&rsquo;onest&agrave;, della trasparenza, della correttezza e lealt&agrave;, negli affari, insieme al rispetto degli interessi di ogni interlocutore e dei principi di libera concorrenza, pertanto richiede a tutti i collaboratori comportamenti idonei e conformi alle leggi e ai regolamenti aziendali. IBI, come produttore di farmaci per la salute umana, impegna tutti i propri collaboratori affinch&eacute; questo obiettivo, primario e assoluto, sia sempre perseguito con il massimo di qualit&agrave;, nella piena consapevolezza dell&rsquo;importanza dei farmaci per il benessere delle persone. IBI si impegna ad operare in modo responsabile, a valorizzare le Risorse Umane di cui si avvale e a tutelare l&rsquo;ambiente in cui opera. IBI vuole assicurare che, attraverso idonei strumenti organizzativi, si possa prevenire la violazione dei principi di legalit&agrave;, trasparenza, correttezza e lealt&agrave; da parte dei propri dipendenti e collaboratori e vigiler&agrave; sulla loro osservanza e implementazione.</p>\r\n\r\n<p><strong>Applicazione</strong><br />\r\nIl Codice Etico si applica a tutte le attivit&agrave; aziendali e costituisce punto di riferimento per la regolamentazione adottata dalle diverse Direzioni della societ&agrave;. E&rsquo; a cura di IBI la diffusione di quanto contenuto nel presente Codice affinch&eacute; tutti coloro che intrattengono rapporti con l&rsquo;azienda, siano a conoscenza di questi standard aziendali e ne comprendano completamente contenuti e finalit&agrave;.</p>\r\n\r\n<p><strong>Norme e Standard di comportamento</strong><strong>Regolamento Aziendale.</strong><br />\r\nCriteri guida nelle politiche verso i collaboratori In primo luogo vanno messe la tutela della dignit&agrave; e della salute di tutti coloro che intrattengono rapporti di lavoro con l&rsquo;azienda. Di altrettanta importanza &egrave; la sicurezza individuale e collettiva sul lavoro. IBI &egrave; impegnata altres&igrave; ad offrire pari opportunit&agrave; di lavoro senza distinzioni basate su etnia, religione, opinioni, nazionalit&agrave;, sesso, condizioni fisiche, et&agrave;, condizioni sociali. IBI cura la formazione tecnica, professionale ed umana dei propri collaboratori.</p>\r\n\r\n<p><strong>Criteri guida tra e per i collaboratori</strong><br />\r\nLa conformit&agrave; dei comportamenti alla legge vigente &egrave; un requisito essenziale e tassativo per IBI e per tutti i suoi collaboratori. Ogni collaboratore deve essere a conoscenza delle implicazioni di legge relative alla propria attivit&agrave;. Il comportamento dei collaboratori di IBI, oltre che ad essere in sintonia con le politiche aziendali, deve fondarsi su principi di collaborazione, responsabilit&agrave;, professionalit&agrave; e diligenza. La politica aziendale relativa ai rapporti con e tra i dipendenti si impronta a criteri di lealt&agrave; e persegue il constante obiettivo del rispetto della dignit&agrave; personale. A tal fine, IBI non tollera nel proprio ambiente lavorativo discriminazioni e molestie di alcun tipo, ne comportamenti lesivi della sicurezza e salute sul posto di lavoro dovuti ad abuso di alcol o droghe, ne comportamenti integranti gli estremi di minacce, abusi e/o violenze da parte o contro i propri dipendenti durante lo svolgimento delle mansioni lavorative.</p>\r\n\r\n<p><strong>Doveri e responsabilit&agrave;</strong><br />\r\n<i>Conflitto d&rsquo;interessi:</i></p>\r\n\r\n<ul>\r\n	<li>I collaboratori di IBI devono rispettare le regole del presente Codice anche nei rapporti verso l&rsquo;esterno, in particolare:</li>\r\n	<li>I collaboratori devono informare in modo adeguato i soggetti terzi del contenuto delle disposizioni del presente Codice al fine di esigere il rispetto e comprensione del proprio comportamento e operato.</li>\r\n	<li>I collaboratori di IBI devono adoperarsi per evitare situazioni in grado di generare conflitti di interesse sia reale, sia potenziale tra attivit&agrave; strettamente personali e aziendali; pertanto trasparenza, onest&agrave; e fiducia sono valori che devono essere rispettati sempre e comunque.</li>\r\n	<li>Nessun dipendente di IBI, inoltre, pu&ograve; ottenere vantaggi personali in relazione all&rsquo;attivit&agrave; esplicata per conto di IBI.</li>\r\n</ul>\r\n\r\n<p>Nel caso di insorgenza di situazioni di potenziale conflitto, sar&agrave; essenziale la tempestiva comunicazione tra il collaboratore ed il proprio superiore al fine di risolvere la questione.<br />\r\n<br />\r\n<i>- Le informazioni aziendali: uso e tutela.</i><br />\r\nLa riservatezza delle informazioni &egrave; un bene che IBI tutela anche attraverso i propri collaboratori: ogni informazione ottenuta da un collaboratore in relazione alla propria attivit&agrave; &egrave; di propriet&agrave; di IBI. I dati che riguardano le persone saranno trattati nel rispetto delle disposizioni vigenti in materia. I collaboratori che vengono a conoscenza di informazioni non di pubblico dominio devono usare la massima cautela e cura nell&rsquo;utilizzare tali informazioni, evitandone la divulgazione a persone non autorizzate, sia all&rsquo;interno, sia all&rsquo;esterno dell&rsquo;azienda.</p>\r\n\r\n<p><strong>Rapporti con la Pubblica Amministrazione, organizzazioni politiche e sindacali</strong><br />\r\nI rapporti con le Istituzioni Pubbliche saranno tenuti solo dalle funzioni a ci&ograve; autorizzate. Tutti i rapporti che coinvolgono le funzioni aziendali con la Pubblica Amministrazione devono rispettare i principi di diligenza, trasparenza ed onest&agrave;. <i>collaboratori di IBI devono tenere un comportamento ispirato alla massima correttezza ed integrit&agrave; nei rapporti con dipendenti e rappresentanti di enti pubblici, forze politiche e sindacali.</i>Nel caso in cui IBI utilizzi un consulente o un soggetto terzo per essere rappresentato nei rapporti verso la Pubblica Amministrazione, nei confronti di tale soggetto si applicano le stesse direttive impartite ai dipendenti di IBI.</p>\r\n\r\n<p><strong>Rapporti con gli operatori sanitari/clienti</strong><br />\r\nI collaboratori di IBI conformano il loro comportamento al Codice deontologico di Farmindustria e alle eventuali altre norme specifiche che la Societ&agrave; dovesse adottare al riguardo.</p>\r\n\r\n<p><strong>Controlli</strong><br />\r\nIl sistema di controllo interno deve essere orientato all&rsquo;adozione di strumenti e metodologie volti a contrastare i potenziali rischi aziendali, al fine di determinare una ragionevole garanzia circa il rispetto non solo delle leggi, ma anche delle disposizioni e procedure interne. Il management aziendale deve curare costantemente la conformit&agrave; dei comportamenti a quanto indicato nel Codice e, se necessario, realizzare speciali programmi di verifica. Organi preposti alla verifica dell&rsquo;efficacia del sistema di controllo interno sono: il Consiglio di Amministrazione; il Presidente, l&rsquo;Amministratore Delegato.</p>\r\n\r\n<p><strong>Integrazione del Codice</strong><br />\r\nQuesto Codice costituisce parte integrante del &ldquo;Modello di organizzazione, gestione e controllo&rdquo; previsto dall&rsquo;art. 6 del Decreto Legislativo 231/2001 in materia di &quot;Disciplina della responsabilit&agrave; amministrativa delle persone giuridiche&quot;. IBI si impegna a diffondere il contenuto di questo Codice a tutti coloro che entreranno in relazione con l&rsquo;azienda. L&rsquo;osservanza del Codice Etico &egrave; affidata indistintamente a tutti i collaboratori della societ&agrave;.</p>\r\n\r\n<p><strong>Sanzioni</strong><br />\r\nL&rsquo;osservanza delle disposizione del presente codice costituisce parte degli obblighi di diligenza e fedelt&agrave; dei dipendenti IBI ai sensi e per gli effetti degli artt. 2104 e 2105 del cod. civ.. In relazione al collegato disposto dell&rsquo;art. 2106 del cod. civ., il presente codice richiama espressamente le disposizioni contenute nel CCNL dell&rsquo;industria chimica &ndash; sia nella versione attualmente in vigore che in qualsiasi futuro rinnovo dello stesso &ndash; in materia di provvedimenti disciplinari.</p>\r\n', 'it'),
(18, 9, '<p><strong></strong></p>\r\n\r\n<h2>IBI: Etic Code</h2>\r\n\r\n<h3>Our history, our values</h3>\r\n\r\n<p><strong></strong></p>\r\n\r\n<p>In adopting the present Ethical Code, Ibi expresses its conviction that respect for the principles contained therein is the prime factor for its success in the management of company business and activities. In addition the company expresses its will to work in such a manner that the main objective of the company be that of satisfying the needs and expectations of its business partners.</p>\r\n\r\n<p><strong>Values and Objectives</strong></p>\r\n\r\n<ul>\r\n	<li>Honesty and transparency, correct behaviour, loyalty in business, respect for the interests of all its business partners and the principles of free competition are the basis of Ibi&rsquo;s way of doing business. The company therefore requires suitable behaviour in conformity with the law and company regulations from all its collaborators.</li>\r\n	<li>As producers of medicines for human health, all Ibi&lsquo;s collaborators are committed to following this main, absolute objective with maximum quality in the full awareness of the importance of medicine to the well being of people.</li>\r\n	<li>Ibi is committed to working in a responsible manner, to giving due value to its Human Resources and to protecting the environment in which it operates.</li>\r\n	<li>Ibi wishes to ensure that, through appropriate organizational tools, it is possible to prevent violations of the principles of law, transparency, correctness and loyalty on the part of its employees and collaborators and to ensure their observance and implementation.</li>\r\n</ul>\r\n\r\n<p><strong>Application</strong><br />\r\nThe Ethical Code is applied to all company activities and is a point of reference for the regulations adopted by the different company managements.<br />\r\nIbi assumes responsibility for making sure that all people who have relationships with the company be aware of the contents of this Code and fully understand its content and aims.</p>\r\n\r\n<p><strong>Norms and Standards of behaviour Company Regulations</strong></p>\r\n\r\n<ul>\r\n	<li>Guidelines in policy regarding collaborators</li>\r\n	<li>The dignity and health of all those who have working relationships with the company are of primary importance as are individual and collective safety on the workplace.</li>\r\n</ul>\r\n\r\n<p>Ibi is committed to offering equal opportunity employment indifferent to distinctions based on ethnical, religious, political, national, sexual, physical, age or social conditions. Ibi takes care of the technical and professional training of its employees.</p>\r\n\r\n<p><strong>Guidelines for behaviour for and between collaborators</strong><br />\r\nConformity with the law is an essential and absolute requirement for Ibi and all its collaborators. Each collaborator must be aware of the legal implications of his/her activities.<br />\r\nIn addition to being in line with company policy, the behaviour of Ibi&rsquo;s collaborators must be based on principles of collaboration, responsibility, professionalism and diligence. As regards the relationships with and between employees, the main criterion of company policy is loyalty with the continuous aim of respect for personal dignity. To this end, Ibi will not tolerate discrimination or abuse of any kind on its work premises, nor will it tolerate behaviour damaging to safety and health in the workplace due to the abuse of alcohol or drugs or menacing, abusive or violent behaviour on the part of or towards its employees during the carrying out of their work.</p>\r\n\r\n<p><strong>Duties and responsibilities</strong><br />\r\n<i>Conflict of interest</i></p>\r\n\r\n<p>Ibi&rsquo;s collaborators must also respect the rules detailed in this Code in relationship to external parties as follows:</p>\r\n\r\n<ul>\r\n	<li>Collaborators must inform third parties of the contents of this code in an appropriate manner so as to win respect for and understanding of their own behaviour and work.</li>\r\n	<li>Ibi&rsquo;s collaborators must make sure to avoid situations able to create conflicts of interest, both real and potential, between personal and company related activities. Transparency, honesty and trust are values that must always be respected.</li>\r\n	<li>No Ibi employee may obtain personal advantages from activities carried out for the company.</li>\r\n</ul>\r\n\r\n<p>Should situations of potential conflict arise, employees are required to inform their superiors as soon as possible in order to resolve the matter.</p>\r\n\r\n<p>C<i>ompany information: use and safeguarding</i><br />\r\nThe confidentiality of information is an asset to be safeguarded for Ibi through its employees as well. All information obtained by an employee relating to his/her job is the property of Ibi. Data regarding people is treated in respect of the laws in force regulating this matter.<br />\r\nEmployees who come to know confidential information must use the greatest caution and care to maintain the confidentiality of such information from non authorized people both in and out of the company</p>\r\n\r\n<ul>\r\n	<li>Relations with the Public Administration, political organizations and trade unions</li>\r\n</ul>\r\n\r\n<p>Only authorized functions will have relations with Public Institutions. All relations the company has with the Public Administration must respect the principles of diligence, transparency and honesty.<br />\r\nCorrectness and integrity much characterize the behaviour of Ibi&rsquo;s employees in their relations with staff and representative of public bodies, political institutions and trade unions.<br />\r\nShould Ibi use the services of a consultant or third party to represent it in its relations with the Public Administration, the same rules apply to such a representative as do to all Ibi employees.</p>\r\n\r\n<p><strong>Relations with health officials/clients</strong><br />\r\nThe behavior of Ibi employees must conform to the regulations of the &ldquo;Codice Deontologico&rdquo; of Farmindustria and to any other specific related regulations the company may apply.</p>\r\n\r\n<p><strong>Controls</strong><br />\r\nThe internal control system must aim at using instruments and methods to eliminate possible risks to the company in order to provide a reasonable guarantee regarding respect not only of the laws but also of internal regulations and procedures.<br />\r\nThe company management is responsible for monitoring that the behavior of all employees conforms to that stated in the Code and, if necessary, carry out special monitoring programs.<br />\r\nThe Board of Directors, the President and the Managing Director are responsible for verifying the efficacy of the internal control system.</p>\r\n\r\n<p><strong>Integration of the Code</strong><br />\r\nThis Code is an integration of the &lsquo;Model for organization management, and control&rsquo; foreseen by article 6 of the law 231/2001 regarding &quot;Discipline of the administrative responsibility of persone giuridiche&quot;.<br />\r\nIbi is committed to informing all those who interact with the company of the contents of this code<br />\r\nObservance of the Ethical code is required of all employees and collaborators of the company without exception.</p>\r\n\r\n<p><strong>Sanctions</strong><br />\r\nObservance of the regulations in this code constitutes part of the obligations of diligence and loyalty of Ibi employees as stipulated by articles 2104 and 2105 of the civil law code. In relation to the agreement between article 2106 of the civil law code and this code, the latter expressly refers to the regulations contained in the CCNL of the chemical industry &ndash; both in the version currently in force and in all future modifications of the same &ndash; in the matter of disciplinary actions.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'en'),
(19, 10, '<h2>IBI: Quality Unit System</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<h4>La qualit&agrave;</h4>\r\n\r\n<h5>Il sistema di qualit&agrave;</h5>\r\n\r\n<p>Assicurare la Qualit&agrave; dei Nostri Prodotti Il Sistema di Qualit&agrave; dell&rsquo;Istituto Biochimico Italiano G. Lorenzini (IBI) recepisce e integra le norme nazionali (AIFA) ed internazionali (EU GMP e 21 CFR 210-211 per US FDA) allo scopo di tutelare la salute del paziente. In un&rsquo;ottica di miglioramento continuo il Sistema di Qualit&agrave; cura l&rsquo;intero ciclo di vita dei nostri prodotti garantendone costantemente la Qualit&agrave;. L&rsquo; Unit&agrave; di Qualit&agrave; &egrave; il filo conduttore dell&rsquo;attivit&agrave; produttiva di IBI. L&rsquo;Unit&agrave; di Qualit&agrave; include le attivit&agrave; di Controllo Qualit&agrave; e di Assicurazione Qualit&agrave; le cui funzionalit&agrave; e responsabilit&agrave; sono separate tra di loro ma sinergicamente a servizio della salute pubblica.</p>\r\n\r\n<div class="evidence-box">Il controllo Qualit&agrave; &egrave; un processo che segue tutta la vita del farmaco, dal suo sviluppo fino al suo utilizzo. Da sempre l&rsquo;IBI &egrave; Impegnata nel mantenere elevati standard di qualit&agrave;. Ogni operazione compiuta dal personale dell&rsquo;azienda rispetta precise procedure operative standard create per garantire la sicurezza e l&rsquo;efficacia dei farmaci prodotti. Assicurazione Qualit&agrave; e il Controllo Qualit&agrave; lavorano costantemente al servizio della salute.</div>\r\n\r\n<h5>I laboratori di Controllo Qualit&agrave;</h5>\r\n\r\n<p>L&rsquo; Istituto Biochimico Italiano si avvale di moderni Laboratori di Controllo Qualit&agrave; autorizzati dalle Autorit&agrave; Competenti (AIFA-USFDA) ad eseguire tutte le analisi necessarie per controllare la qualit&agrave; di medicinali ed APIs ad uso umano e sperimentale (GMP). Le attivit&agrave; analitiche, eseguite in accordo ai principi e alle Norme di Buona Fabbricazione (GMP), abbracciano numerosi aspetti della vita dei nostri prodotti: Analisi delle Materie Prime Controllo dei Materiali di confezionamento Controlli di Processo Analisi di rilascio dei prodotti finiti Analisi di Stabilit&agrave; Controlli Ambientali delle aree produttive Controlli di pulizia delle aree e delle attrezzature di produzione Qui tecnici specializzati preparati e costantemente aggiornati, con alta professionalit&agrave; seguono le attivit&agrave; produttive e verificano la rispondenza dei prodotti alle specifiche applicando le procedure del nostro Sistema di Gestione Qualit&agrave;.</p>\r\n\r\n<div class="evidence-box">I laboratori di Controllo Qualit&agrave; eseguono su ogni lotto tutte le analisi previste confermando la conformit&agrave; del prodotto alle specifiche approvate dalle Autorit&agrave; Nazionali e internazionali, quali FDA, AIFA, MHRA ecc.</div>\r\n\r\n<h5>L&rsquo;Assicurazione di Qualit&agrave;</h5>\r\n\r\n<p>Assicurazione Qualit&agrave; &egrave; costantemente impegnata nel definire e supervisionare il livello di Qualit&agrave;:</p>\r\n\r\n<ul>\r\n	<li>Seleziona con cura e monitora costantemente i propri fornitori di materie prime e di materiali eseguendo audit presso i siti produttivi;</li>\r\n	<li>Svolge continua e costante formazione del personale che fa parte della catena produttiva e distributiva dei propri prodotti;</li>\r\n	<li>Assicura che ogni lotto di APIs e medicinali sia stato stati fabbricato e controllato conformemente alle disposizioni della sua autorizzazione all&#39;immissione in commercio, ai principi e alle linee guida delle norme di buona fabbricazione della EU e US e alle norme di buona fabbricazione di un paese terzo riconosciute come equivalenti nel quadro di un accordo di mutuo riconoscimento o ad ogni altra pertinente prescrizione giuridica prima della sua immissione sul mercato;</li>\r\n	<li>Vigila sulle condizioni generali di igiene dei locali e la rispondenza ai requisiti di legge e alle norme di Buona Fabbricazione eseguendo self-audit;</li>\r\n	<li>Supervisione e controlla tutte le operazioni di produzione e controllo e la corretta applicazione delle procedure operative standard che ha definito a garanzia della Qualit&agrave; dei nostri prodotti;</li>\r\n	<li>Promuove ed &egrave; parte attiva del Sistema di Gestione del Rischio su cui si basa il nostro Sistema di Qualit&agrave;, definendo la migliore strategia possibile per ridurre gli effetti dei rischi a livelli accettabili attraverso una continua analisi dei processi volta a valutare, controllare, notificare e revisionare i rischi stessi.</li>\r\n</ul>\r\n\r\n<div class="evidence-box">L&rsquo;Assicurazione di Qualit&agrave; garantisce che i principi e le norme di Buona Fabbricazione (GMPs, Good Manufacturing Practices) siano applicati sempre in modo coerente.</div>\r\n\r\n<h5>Il sistema di qualit&agrave;</h5>\r\n\r\n<p>I nostri impianti e i Laboratori sono regolarmente ispezionati ed approvati dalle Autorit&agrave; Ministeriali competenti e da numerosi Quality Assurance e Quality Control provenienti da aziende italiane e multinazionali Autorizzazione dell&#39;AIFA ad effettuare, secondo le norme di buona fabbricazione (GMP), in qualit&agrave; di officina farmaceutica per le seguenti attivit&agrave; produttive:</p>\r\n\r\n<ul>\r\n	<li>Produzione di sostanze attive per sintesi chimica</li>\r\n	<li>Produzioni di sostanze attive sterili</li>\r\n	<li>Produzioni di sostanze attive mediante processi Biologici</li>\r\n	<li>Prodotti sterili (Preparati in asepsi)</li>\r\n	<li>Liofilizzati Liquidi di piccolo volume</li>\r\n	<li>Polveri Prodotti sterili (Sterilizzazione terminale)</li>\r\n	<li>Liquidi di piccolo volume Prodotti non sterili</li>\r\n	<li>Capsule di gelatina dura</li>\r\n	<li>Liquidi per uso interno&nbsp;Semisolidi</li>\r\n	<li>Compresse Autorizzazione&nbsp;dell&#39;AIFA ad effettuare, secondo le norme di buona fabbricazione (GMP), in qualit&agrave; di officina farmaceutica, controlli biologici, microbiologici (sterilit&agrave; e diversi da sterilit&agrave;), chimici, chimico-fisici su Specialit&agrave; Medicinali e Materie Prime farmacologicamente attive ad uso umano. Autorizzazione del Ministero della Salute ai sensi del Decreto Legislativo 12 Aprile 2001, n. 206, concernente l&#39;impiego confinato di microrganismi geneticamente modificati.</li>\r\n</ul>\r\n\r\n<div class="evidence-box">Il Sistema di Qualit&agrave; dell&rsquo;Istituto Biochimico Italiano G. Lorenzini &egrave; costantemente e periodicamente controllato e certificato dalle dagli organismi di vigilanza, nazionali e internazionali, quali FDA, EMA, ISS e AIFA Certiquality.</div>\r\n', 'it');
INSERT INTO `contenuti_translations` (`id`, `contenuti_id`, `testo`, `locale`) VALUES
(20, 10, '<h2>IBI: Quality Unit System</h2>\r\n\r\n<h3>Our history, our values</h3>\r\n\r\n<h4>La qualit&agrave;</h4>\r\n\r\n<h5>Il sistema di qualit&agrave;</h5>\r\n\r\n<p>Assicurare la Qualit&agrave; dei Nostri Prodotti Il Sistema di Qualit&agrave; dell&rsquo;Istituto Biochimico Italiano G. Lorenzini (IBI) recepisce e integra le norme nazionali (AIFA) ed internazionali (EU GMP e 21 CFR 210-211 per US FDA) allo scopo di tutelare la salute del paziente. In un&rsquo;ottica di miglioramento continuo il Sistema di Qualit&agrave; cura l&rsquo;intero ciclo di vita dei nostri prodotti garantendone costantemente la Qualit&agrave;. L&rsquo; Unit&agrave; di Qualit&agrave; &egrave; il filo conduttore dell&rsquo;attivit&agrave; produttiva di IBI. L&rsquo;Unit&agrave; di Qualit&agrave; include le attivit&agrave; di Controllo Qualit&agrave; e di Assicurazione Qualit&agrave; le cui funzionalit&agrave; e responsabilit&agrave; sono separate tra di loro ma sinergicamente a servizio della salute pubblica.</p>\r\n\r\n<div class="evidence-box">Il controllo Qualit&agrave; &egrave; un processo che segue tutta la vita del farmaco, dal suo sviluppo fino al suo utilizzo. Da sempre l&rsquo;IBI &egrave; Impegnata nel mantenere elevati standard di qualit&agrave;. Ogni operazione compiuta dal personale dell&rsquo;azienda rispetta precise procedure operative standard create per garantire la sicurezza e l&rsquo;efficacia dei farmaci prodotti. Assicurazione Qualit&agrave; e il Controllo Qualit&agrave; lavorano costantemente al servizio della salute.</div>\r\n\r\n<h5>I laboratori di Controllo Qualit&agrave;</h5>\r\n\r\n<p>L&rsquo; Istituto Biochimico Italiano si avvale di moderni Laboratori di Controllo Qualit&agrave; autorizzati dalle Autorit&agrave; Competenti (AIFA-USFDA) ad eseguire tutte le analisi necessarie per controllare la qualit&agrave; di medicinali ed APIs ad uso umano e sperimentale (GMP). Le attivit&agrave; analitiche, eseguite in accordo ai principi e alle Norme di Buona Fabbricazione (GMP), abbracciano numerosi aspetti della vita dei nostri prodotti: Analisi delle Materie Prime Controllo dei Materiali di confezionamento Controlli di Processo Analisi di rilascio dei prodotti finiti Analisi di Stabilit&agrave; Controlli Ambientali delle aree produttive Controlli di pulizia delle aree e delle attrezzature di produzione Qui tecnici specializzati preparati e costantemente aggiornati, con alta professionalit&agrave; seguono le attivit&agrave; produttive e verificano la rispondenza dei prodotti alle specifiche applicando le procedure del nostro Sistema di Gestione Qualit&agrave;.</p>\r\n\r\n<div class="evidence-box">I laboratori di Controllo Qualit&agrave; eseguono su ogni lotto tutte le analisi previste confermando la conformit&agrave; del prodotto alle specifiche approvate dalle Autorit&agrave; Nazionali e internazionali, quali FDA, AIFA, MHRA ecc.</div>\r\n\r\n<h5>L&rsquo;Assicurazione di Qualit&agrave;</h5>\r\n\r\n<p>Assicurazione Qualit&agrave; &egrave; costantemente impegnata nel definire e supervisionare il livello di Qualit&agrave;:<br />\r\n&bull; Seleziona con cura e monitora costantemente i propri fornitori di materie prime e di materiali eseguendo audit presso i siti produttivi;<br />\r\n&bull; Svolge continua e costante formazione del personale che fa parte della catena produttiva e distributiva dei propri prodotti; &bull; Assicura che ogni lotto di APIs e medicinali sia stato stati fabbricato e controllato conformemente alle disposizioni della sua autorizzazione all&#39;immissione in commercio, ai principi e alle linee guida delle norme di buona fabbricazione della EU e US e alle norme di buona fabbricazione di un paese terzo riconosciute come equivalenti nel quadro di un accordo di mutuo riconoscimento o ad ogni altra pertinente prescrizione giuridica prima della sua immissione sul mercato; &bull; Vigila sulle condizioni generali di igiene dei locali e la rispondenza ai requisiti di legge e alle norme di Buona Fabbricazione eseguendo self-audit; &bull; Supervisione e controlla tutte le operazioni di produzione e controllo e la corretta applicazione delle procedure operative standard che ha definito a garanzia della Qualit&agrave; dei nostri prodotti; &bull; Promuove ed &egrave; parte attiva del Sistema di Gestione del Rischio su cui si basa il nostro Sistema di Qualit&agrave;, definendo la migliore strategia possibile per ridurre gli effetti dei rischi a livelli accettabili attraverso una continua analisi dei processi volta a valutare, controllare, notificare e revisionare i rischi stessi.</p>\r\n\r\n<div class="evidence-box">L&rsquo;Assicurazione di Qualit&agrave; garantisce che i principi e le norme di Buona Fabbricazione (GMPs, Good Manufacturing Practices) siano applicati sempre in modo coerente.</div>\r\n\r\n<h5>Il sistema di qualit&agrave;</h5>\r\n\r\n<p>I nostri impianti e i Laboratori sono regolarmente ispezionati ed approvati dalle Autorit&agrave; Ministeriali competenti e da numerosi Quality Assurance e Quality Control provenienti da aziende italiane e multinazionali Autorizzazione dell&#39;AIFA ad effettuare, secondo le norme di buona fabbricazione (GMP), in qualit&agrave; di officina farmaceutica per le seguenti attivit&agrave; produttive: Produzione di sostanze attive per sintesi chimica Produzioni di sostanze attive sterili Produzioni di sostanze attive mediante processi Biologici Prodotti sterili (Preparati in asepsi) Liofilizzati Liquidi di piccolo volume Polveri Prodotti sterili (Sterilizzazione terminale) Liquidi di piccolo volume Prodotti non sterili Capsule di gelatina dura Liquidi per uso interno Semisolidi Compresse Autorizzazione del dell&#39;AIFA ad effettuare, secondo le norme di buona fabbricazione (GMP), in qualit&agrave; di officina farmaceutica, controlli biologici, microbiologici (sterilit&agrave; e diversi da sterilit&agrave;), chimici, chimico-fisici su Specialit&agrave; Medicinali e Materie Prime farmacologicamente attive ad uso umano. Autorizzazione del Ministero della Salute ai sensi del Decreto Legislativo 12 Aprile 2001, n. 206, concernente l&#39;impiego confinato di microrganismi geneticamente modificati.</p>\r\n\r\n<div class="evidence-box">Il Sistema di Qualit&agrave; dell&rsquo;Istituto Biochimico Italiano G. Lorenzini &egrave; costantemente e periodicamente controllato e certificato dalle dagli organismi di vigilanza, nazionali e internazionali, quali FDA, EMA, ISS e AIFA Certiquality.</div>\r\n', 'en'),
(21, 11, '<h2>IBI: Politica integrata</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p>La IBI agisce affinch&eacute; l&rsquo;operativit&agrave; delle diverse realt&agrave; aziendali si svolgano salvaguardando la salute delle persone, la sicurezza delle operazioni e l&rsquo;ambiente.<br />\r\nLa Politica Salute, Sicurezza e Ambiente esprime l&rsquo;impegno della IBI su questi temi.</p>\r\n\r\n<div class="evidence-box">\r\n<ul>\r\n	<li><a href="/files/2/56b1f27cad04f.pdf" target="_blank">Politica Aziendale rev_6</a></li>\r\n	<li><a href="/files/2/56b1f2d825e70.pdf" target="_blank">OHSAS 18001</a></li>\r\n	<li><a href="/files/2/56b1f30936b78.pdf" target="_blank">UNI EN ISO 14001 2004</a></li>\r\n</ul>\r\n</div>\r\n', 'it'),
(22, 11, '<h2>IBI: Integrated policy</h2>\r\n\r\n<h3>Our history, our values</h3>\r\n\r\n<p>IBI acts in a way that all different company aspects safeguard people health, safety and environment.<br />\r\nHealth, Safety and Environment policy declares IBI&rsquo;s commitment on these topics.</p>\r\n\r\n<div class="evidence-box">\r\n<ul>\r\n	<li><a href="/files/2/56cda24a8380b.PDF" target="_blank">Politica Aziendale rev_6</a></li>\r\n	<li><a href="/files/2/56b1f2d825e70.pdf" target="_blank">OHSAS 18001</a></li>\r\n	<li><a href="/files/2/56b1f30936b78.pdf" target="_blank">UNI EN ISO 14001 2004</a></li>\r\n</ul>\r\n</div>\r\n', 'en'),
(23, 12, '<h2>IBI: Trasferimenti di valore</h2>\r\n\r\n<p>In base alle disposizioni del Codice Deontologico Farmindustria, che ha recepito a sua volta il codice EFPIA, &egrave; stato stabilito l&rsquo;obbligo per le aziende farmaceutiche aderenti di documentare e rendere pubblici sul proprio website aziendale, su base annuale e per un periodo di almeno tre anni, i trasferimenti di valore effettuati direttamente o indirettamente con Operatori e Organizzazioni sanitarie.</p>\r\n\r\n<p>I trasferimenti di valore sono relativi a spese di finanziamenti diretti o indiretti ad eventi congressuali, donazioni, consulenze, prestazioni professionali, partecipazione a convegni e congressi (quota di iscrizione, viaggio e ospitalit&agrave;).</p>\r\n', 'it'),
(24, 12, '<h2>IBI: Trasferimenti di valore</h2>\r\n\r\n<p>In base alle disposizioni del Codice Deontologico Farmindustria, che ha recepito a sua volta il codice EFPIA, &egrave; stato stabilito l&rsquo;obbligo per le aziende farmaceutiche aderenti di documentare e rendere pubblici sul proprio website aziendale, su base annuale e per un periodo di almeno tre anni, i trasferimenti di valore effettuati direttamente o indirettamente con Operatori e Organizzazioni sanitarie.</p>\r\n\r\n<p>I trasferimenti di valore sono relativi a spese di finanziamenti diretti o indiretti ad eventi congressuali, donazioni, consulenze, prestazioni professionali, partecipazione a convegni e congressi (quota di iscrizione, viaggio e ospitalit&agrave;).</p>\r\n', 'en'),
(25, 13, '<p>Il sito produttivo di IBI ha una superficie totale di 40.000 mq ed &egrave; composto da tre edifici dove vengono eseguite le attivit&agrave; di produzione e di stoccaggio.<br />\r\nIl sito produce sia prodotti &beta;-lattamici che prodotti non &beta;-lattamici e la produzione &egrave; certificata sia AIFA che FDA.</p>\r\n\r\n<p>I nostri principali prodotti sono:<br />\r\nProdotti Sterili non &beta;-lattamici (preparati in asepsi e sterilizzati terminalmente);<br />\r\nProdotti non sterili in differenti forme farmaceutiche (solidi, semisolidi e liquidi), con particolare approvazione per la produzione di compresse di ormoni o sostanze ad azione ormonica tranne gli ormoni corticosteroidi e sessuali;<br />\r\nProdotti Sterili &beta;-Lattamici (Penicilline) sia in Bulk che in forma di prodotto semilavorato e finito.</p>\r\n\r\n<p>Data la natura complessa e diversificata delle sue produzioni IBI fin da sempre ha soddisfatto tutti i requisiti normativi vigenti in base alla prevenzione del rischio di cross-contaminazione &beta; -non &beta;.</p>\r\n\r\n<p>Altrettanto significativo &egrave; l&rsquo;approccio responsabile con cui gestiamo i nostri impianti e l&rsquo;attenzione che poniamo all&rsquo;impatto ambientale e alla ricerca di standard elevati per la sicurezza dei nostri lavoratori.<br />\r\nIl riconoscimento di tale attenzione &egrave; rappresentato dalle certificazioni ISO 14001 e OHSAS 18001 raggiunte dal nostro sito.<br />\r\nLa nostra missione &egrave; quella di offrire valore aggiunto ai nostri clienti, puntando su fattori critici di successo come la dedizione al cliente, compliance, competitivit&agrave; dei costi, sviluppo delle persone e dell&rsquo;organizzazione, tecnologia e innovazione.</p>\r\n', 'it'),
(26, 13, '<p>IBI has been present for several years in the area of the &ldquo;Contract Development and Manufacturing Organization&rdquo; (CDMO) basing on a well organized and skilled operative structure which allows to perform all the drug development cycle, from the laboratory study to the industrial production according to c-GMP.</p>\r\n\r\n<p>Concerning the APIs production, inside the Biotech department it is possible to produce recombinant protein from mammalian cells, and the plant has been recently approved (2015) by AIFA for the manufacturing in GMP of biological Investigational Medicinal Products. The manufacturing cycle starts from the cells fermentation followed by the purification up to obtain and characterize the final protein.</p>\r\n\r\n<p>The use of disposable equipment overcomes all the issues potentially arising from cross-contamination phenomena connected to the multipurpose production plants, consequently all the activities related to the cleaning validations are strongly reduced.</p>\r\n\r\n<p>The Development activity is supported by a Technical Laboratory, equipped with modern instruments either for analytical characterization and for formulations development, namely for freeze-drying processes. The Laboratory activity, which studies from small molecules to biotechnological macromolecules, supports the following processes scaling up, up to the industrial GMP validation with a high percentage of success.</p>\r\n\r\n<p>All the activities are constantly supervised through the Analytical Development Laboratory, which develops and validates the analytical methods involved in the <i>in process controls</i>, finished products release and stability programs. The instrumental equipment include HPLC, GC, UPLC,DSC, Light Scattering Particle size Analyzer, Capillary Electophoresis, SDS-PAGE, Western Blotting, ELISA, Biolayer Interferometry.</p>\r\n\r\n<p>The Production Plants are authorized for the finished product release, either for commercial and investigational use, with different formulations, from injectable to oral form dosages. For the injectable formulation IBI plant can deal with vials, for liquids and freeze dried products, and with pre.filling syringes dosage form. A dedicated line has been authorized for the production of small batches aimed to Phase I&deg; Clinical studies.</p>\r\n\r\n<p>The Development is completed by the Regulatory Office Service which owns a long expertise on submission procedures for EU, US PMDA, and which supports the customers for the documentation management and the final registration.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'en'),
(27, 14, '<p><img src="/img/grafico-development-ita.jpg" /></p>\r\n\r\n<p>La IBI opera da diversi anni come Contract Development and Manufacturing Organization (CDMO) grazie ad una struttura organizzativa in grado di seguire, con competenza e professionalit&agrave;, tutto l&rsquo;iter di sviluppo per la produzione di un farmaco.</p>\r\n\r\n<p>Per quanto riguarda la produzione degli APIs, nel reparto di biotecnologia possono essere prodotte proteine ricombinanti da cellule di mammifero. E&rsquo; disponibile un impianto GMP, autorizzato da AIFA nel 2015, alla produzione di principi attivi biotecnologici per studi sperimentali. Le attivit&agrave; coprono tutte le fasi della produzione: dalla clonazione del gene, per ottenere la proteina ricombinante, alla fermentazione, purificazione e caratterizzazione del principio attivo.</p>\r\n\r\n<p>Grazie all&rsquo;elevato utilizzo di sistemi disposible, &egrave; possibile seguire pi&ugrave; progetti contemporaneamente, senza rischi di cross contamination e con attivit&agrave; di cleaning validation ridotte al minimo.</p>\r\n\r\n<p>Nella struttura &egrave; presente anche un Laboratorio di Sviluppo Tecnologico in grado di sviluppare formulazioni innovative, per tutte le vie di somministrazione, sia per small molecules che per API biotecnologici. Sono disponibili apparecchiature all&rsquo;avanguardia per lo studio di processi di liofilizzazione, con la possibilit&agrave; di monitorare nel dettaglio il processo, attraverso software dedicati, garantendo elevate percentuali di successo nelle fasi di scale-up industriale dei processi.</p>\r\n\r\n<p>Tutte le attivit&agrave; sono costantemente monitorate dal Laboratorio di Sviluppo Analitico, in grado di individuare e validare metodi utilizzabili per il rilascio GMP che per gli studi di stabilit&agrave;, non solo delle small molecules ma anche di proteine ed anticorpi. Accanto ai tradizionali HPLC e GC, sono presenti UPLC, DSC, Light Scattering (particle size counter), SDS-PAGE, WESTERN BLOTTING, Capillary electrophoresis, ELISA, Potency biological assay, BioLayer Interferometry.</p>\r\n\r\n<p>I reparti produttivi sono autorizzati alla produzione anche di farmaci sperimentali, sia orali che iniettabili (soluzioni e liofilizzati). Accanto ad una linea di dosaggio, in grado di produrre sia flaconcini che siringhe pre-riempite (5000 vials/ora), &egrave; stata inserita una nuova linea, semiautomatica, dedicata alla produzione di lotti sperimentali di Fase I.</p>\r\n\r\n<p>La nostra struttura, grazie ad un Ufficio Regolatorio esperto sia nelle procedure EU, che FDA e PMDA, &egrave; in grado di garantire al Cliente un servizio completo, anche per quanto riguarda gli aspetti regolatori, durante tutte le fasi dello sviluppo di un prodotto (dagli studi clinici alla commercializzazione).</p>\r\n', 'it'),
(28, 14, '<p><img src="/img/grafico-development-eng.jpg" /></p>\r\n\r\n<p>La IBI opera da diversi anni come Contract Development and Manufacturing Organization (CDMO) grazie ad una struttura organizzativa in grado di seguire, con competenza e professionalit&agrave;, tutto l&rsquo;iter di sviluppo per la produzione di un farmaco.</p>\r\n\r\n<p>Per quanto riguarda la produzione degli APIs, nel reparto di biotecnologia possono essere prodotte proteine ricombinanti da cellule di mammifero. E&rsquo; disponibile un impianto GMP, autorizzato da AIFA nel 2015, alla produzione di principi attivi biotecnologici per studi sperimentali. Le attivit&agrave; coprono tutte le fasi della produzione: dalla clonazione del gene, per ottenere la proteina ricombinante, alla fermentazione, purificazione e caratterizzazione del principio attivo.</p>\r\n\r\n<p>Grazie all&rsquo;elevato utilizzo di sistemi disposible, &egrave; possibile seguire pi&ugrave; progetti contemporaneamente, senza rischi di cross contamination e con attivit&agrave; di cleaning validation ridotte al minimo.</p>\r\n\r\n<p>Nella struttura &egrave; presente anche un Laboratorio di Sviluppo Tecnologico in grado di sviluppare formulazioni innovative, per tutte le vie di somministrazione, sia per small molecules che per API biotecnologici. Sono disponibili apparecchiature all&rsquo;avanguardia per lo studio di processi di liofilizzazione, con la possibilit&agrave; di monitorare nel dettaglio il processo, attraverso software dedicati, garantendo elevate percentuali di successo nelle fasi di scale-up industriale dei processi.</p>\r\n\r\n<p>Tutte le attivit&agrave; sono costantemente monitorate dal Laboratorio di Sviluppo Analitico, in grado di individuare e validare metodi utilizzabili per il rilascio GMP che per gli studi di stabilit&agrave;, non solo delle small molecules ma anche di proteine ed anticorpi. Accanto ai tradizionali HPLC e GC, sono presenti UPLC, DSC, Light Scattering (particle size counter), SDS-PAGE, WESTERN BLOTTING, Capillary electrophoresis, ELISA, Potency biological assay, BioLayer Interferometry.</p>\r\n\r\n<p>I reparti produttivi sono autorizzati alla produzione anche di farmaci sperimentali, sia orali che iniettabili (soluzioni e liofilizzati). Accanto ad una linea di dosaggio, in grado di produrre sia flaconcini che siringhe pre-riempite (5000 vials/ora), &egrave; stata inserita una nuova linea, semiautomatica, dedicata alla produzione di lotti sperimentali di Fase I.</p>\r\n\r\n<p>La nostra struttura, grazie ad un Ufficio Regolatorio esperto sia nelle procedure EU, che FDA e PMDA, &egrave; in grado di garantire al Cliente un servizio completo, anche per quanto riguarda gli aspetti regolatori, durante tutte le fasi dello sviluppo di un prodotto (dagli studi clinici alla commercializzazione).</p>\r\n', 'en'),
(29, 15, '<h2><strong>SVILUPPO FORMULATIVO</strong></h2>\r\n\r\n<p>IBI possiede un consolidato <i>know how</i> nello sviluppo formulativo e nella produzione GMP su scala Pilota e industriale di diverse forme solide orali, formulazioni topiche e iniettabili.</p>\r\n\r\n<p>La produzione di formulazioni per uso iniettabile rappresenta un business ormai consolidato e strategico per l&rsquo;azienda, con un reparto <i>multipourpose</i> specificamente dedicato a questa categoria formulativa, operante con aree e strumentazioni classificate nella piena compliance delle c-GMP.<br />\r\nIl reparto &egrave; autorizzato per la produzione di lotti commerciali e per <i>Investigational Medicinal Products</i>, sia per produzioni interne che per attivit&agrave; di <strong><i>custom manufacturing</i></strong>.</p>\r\n\r\n<p>Forte di un Reparto di Sviluppo estremamente flessibile e tecnologicamente all&rsquo;avanguardia, IBI &egrave; particolarmente concentrata sullo sviluppo di formulazioni ad elevato valore aggiunto ed altamente innovative, quali ad esempio i prodotti biotecnologici (<strong>proteine, peptidi, anticorpi</strong>) e formulazioni che si basano sull&rsquo;uso di sistemi <strong>nano e microparticellare</strong> per l&rsquo;inglobamento e il delivery di farmaci di diversa natura.</p>\r\n\r\n<p>IBI ha altres&igrave; una consolidata esperienza nello sviluppo e ottimizzazione di processi di liofilizzazione, tecnologia di elezione per questa classe di prodotti finiti. Inoltre un&rsquo;area del Reparto di produzione sterile &egrave; specificatamente dedicata alla preparazione di formulazioni nano e microparticellari, principalmente a base di polimeri biocompatibili o lipidici, con Equipment capaci di gestire sistemi eterogenei Acqua/Solvente fino ad un volume di 100 L.</p>\r\n\r\n<p>In accordo con le pi&ugrave; recenti linee guida e con le pi&ugrave; moderne metodologie di sviluppo, i Laboratori R&amp;D di IBI adottano il &ldquo;<i>Quality by Design</i>&rdquo; per l&rsquo;ottimizzazione dei processi produttivi, per la caratterizzazione dei parametri critici e per supportare la documentazione prodotta ai fini della presentazione di dossier alle Autorit&agrave; Regolatorie. Tale approccio si concretizza con l&rsquo;applicazione delle tecniche di D.O.E., con la trattazione statistica dei dati raccolti con Software specifici, e con l&rsquo;attuazione di un <i>Risk Management</i> nella fase di scale up e industrializzazione dei processi sviluppati in laboratorio.</p>\r\n\r\n<div class="evidence-box"><strong></strong><strong>Formulazioni Topiche: </strong>Gel, Pomate,fino a 3500 tubi/h</div>\r\n\r\n<div class="evidence-box"><strong></strong><strong>Forme solide orali: </strong>Bustine, Compresse, Capsule, Soluzioni e sospensioni orali</div>\r\n\r\n<div class="evidence-box"><strong>Formulazioni iniettabili:</strong> Polveri liofilizzate in vial per preparazioni iniettabili; Liquidi per uso iniettabile in vial; Liquidi per uso iniettabile in fiala siringa</div>\r\n\r\n<p><!--![endif]----><!--![endif]----><!--![endif]----></p>\r\n', 'it'),
(30, 15, '<h2><strong>FORMULATION DEVELOPMENT</strong></h2>\r\n\r\n<p>IBI owns a well established know how on Formulation Development and on GMP production of different pharmaceutical dosage forms, such as oral, topical and injectable.</p>\r\n\r\n<p>The injectable formulations development and production is one of the most important and strategical business area for IBI, which has started up a multiporpouse plant expressly dedicated to this therapeutic class, operating in full GMP compliance.</p>\r\n\r\n<p>The Department is authorized for the batch production aimed to the Commercial use and also for <i>Investigational Medicinal Products</i>, both for IBI and for <strong><i>custom manufacturing</i></strong> activity.</p>\r\n\r\n<p>IBI is strongly oriented toward the Formulation Development of innovative drugs, which is supported by a modern and technologically advanced R&amp;D department. Among the most promising formulations which are in the development phase there are biotech drugs (such as Proteins, Peptides, and Antybodies) and Micro and Nanoparticles formulations, aimed to the encapsulation and delivery of different classes of active molecules.</p>\r\n\r\n<p>The technique mostly involved in this kind of formulation is the Freeze drying, that is one of the most common and widespread technology for the finished product sterile production, and in which IBI has had a long expertise.</p>\r\n\r\n<p>Moreover an area inside the department has been specifically designated for nano and microparticle formulations preparations, mostly based on biocompatible polymer and/or Solid Lipidic matrixes, with equipment able to work Water/Solvent mixtures up to 100 L volume.</p>\r\n\r\n<p>In accordance to the most recent guidelines for projects development, IBI R&amp;D laboratories apply the &ldquo;<i>Quality by Design</i>&rdquo; approach for the processes optimization and for the critical parameters definition. The results arising from this kind of experimentation constitute a robust support for the documentation preparation addressed to the Regulatory officies.</p>\r\n\r\n<p>The activity is carried out applying the D.O.E. methodology, and calculating the data with specific statistical software. The final aim is to perform, as a general methodology, a <i>Risk Management</i> assessment for the scaling up and industrialization activity.</p>\r\n\r\n<div class="evidence-box"><cite><strong><i>Topical formulations: </i></strong>Gel, Ointment,up to 3500 tube/h</cite></div>\r\n\r\n<div class="evidence-box"><strong><i>Oral dosage forms: </i></strong><i>Sachets, Tablets, Capsule, Oral solutions and suspensions.</i>&nbsp;</div>\r\n\r\n<div class="evidence-box"><strong><i>Injectable formulations</i></strong> Freeze-dried powders, ; liquids in vials and pre-filled syringes;&nbsp;</div>\r\n', 'en'),
(31, 16, '<p>La IBI valuta possibili collaborazioni con istituzioni accademiche sulla base di progetti promettenti nel campo degli anticorpi monoclonali e delle protein ricombinanti. Offriamo servizi come CMO (Contract Manufacturing Organization) operando:</p>\r\n\r\n<ul>\r\n	<li>Sviluppo di line cellulari CHO e produzione Master e Working Cell Banks pronte per la produzione in GMP;</li>\r\n	<li>Sviluppo di processi upstream e downstream;</li>\r\n	<li>Sviluppo e convalida di metodiche analitiche (chimiche, biochimiche e biologiche).</li>\r\n</ul>\r\n\r\n<p>Le nostre Quality Unit, Qualified Person and Ufficio Regolatorio sono in grado di assistere e portare a termine con successo progetti complessi nel campo delle biotecnologie farmaceutiche.</p>\r\n\r\n<p><strong>Collaborazioni in corso</strong></p>\r\n\r\n<ul>\r\n	<li><a href="http://www.stemgen.net/" target="_blank">Stemgen</a></li>\r\n	<li><a href="https://www.iba-lifesciences.com/home.html" target="_blank">IBA Gmbh</a></li>\r\n	<li><a href="http://www.sigma-tau.it/" target="_blank">Sigma-Tau</a></li>\r\n	<li><a href="http://www.ifo.it/index.html" target="_blank">IFO-IRE</a></li>\r\n	<li><a href="http://www3.unitus.it/" target="_blank">Universit&agrave; di Viterbo</a></li>\r\n	<li><a href="http://www.naxospharma.eu/" target="_blank">Naxospharma</a></li>\r\n	<li><a href="http://www.mediapharma.it/" target="_blank">Mediapharma</a></li>\r\n</ul>\r\n', 'it'),
(32, 16, '<p>We are open to evaluate possible collaborations with academic institutions on the basis of promising projects in the fields of monoclonal antibodies and recombinant proteins. We can:</p>\r\n\r\n<ul>\r\n	<li>Develop recombinant CHO cell lines and produce MCB and WCB in GMP ready for the clinical phases;</li>\r\n	<li>Develop upstream and downstream processes;</li>\r\n	<li>Develop and validate analytical methods (chemical and biological).</li>\r\n</ul>\r\n\r\n<p>We are committed to work as CMO (Contract Manufacturing Organization) for upstream and downstream processes for the production of monoclonal antibodies and recombinant proteins from CHO cells. Our Quality Unit, Qualified Person and Regulatory Office can assist the management of complex projects in the biopharmaceutical field.</p>\r\n\r\n<p><strong>Ongoing Collaborations with:</strong></p>\r\n\r\n<ul>\r\n	<li><a href="http://www.stemgen.net/">Stemgen</a></li>\r\n	<li><a href="https://www.iba-lifesciences.com/home.html">IBA Gmbh</a></li>\r\n	<li><a href="http://www.sigma-tau.it/">Sigma-Tau</a></li>\r\n	<li><a href="http://www.ifo.it/index.html">IFO-IRE</a></li>\r\n	<li><a href="http://www3.unitus.it/">Universit&agrave; di Viterbo</a></li>\r\n	<li><a href="http://www.naxospharma.eu/">Naxospharma</a></li>\r\n	<li><a href="http://www.mediapharma.it/">Mediapharma</a></li>\r\n</ul>\r\n', 'en'),
(33, 17, '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Autem placeat nulla, inventore hic voluptatem distinctio asperiores. Numquam maxime id, voluptate rem quisquam voluptates. Consequuntur quo voluptatem asperiores qui. Aperiam, ducimus.</p>', 'it'),
(34, 17, '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Autem placeat nulla, inventore hic voluptatem distinctio asperiores. Numquam maxime id, voluptate rem quisquam voluptates. Consequuntur quo voluptatem asperiores qui. Aperiam, ducimus.</p>', 'en'),
(35, 18, '<p>Il Reparto di Biotecnologie della IBI-Lorenzini produce protein ricombinanti da cellule CHO.</p>\r\n\r\n<p>Nel 2015 abbiamo ricevuto dall&rsquo;AIFA (aut. n&deg; UAO/103050/P) l&rsquo;autorizzazione alla produzione in GMP della proteina ricombinante BMP4 (Bone Morphogenetic Protein). Tale proteina ha gi&agrave; ottenuto la designazione di <a href="http://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/orphans/2014/11/human_orphan_001433.jsp&amp;mid=WC0b01ac058001d12b" target="_blank">farmaco orfano dall&rsquo;EMA</a>&nbsp;per il trattamento del glioma.</p>\r\n\r\n<p>Inoltre, il Reparto di Biotecnologie &egrave; coinvolto in progetti finalizzati a portare in fase clinica prodotti oncologici innovativi. In particolare, stiamo sviluppando un anticorpo monoclonale umanizzato anti-ErbB2 dotato di peculiarit&agrave; promettenti e potenzialmente rivoluzionarie nel trattamento dei tumori esprimenti tale marker.</p>\r\n\r\n<p>Infine, abbiamo sviluppato un processo di produzione per l&rsquo;eritropoietina alpha biosimilare.</p>\r\n', 'it'),
(36, 18, '<p>The Biotech Dept. at IBI-Lorenzini is committed to the production of recombinant proteins from CHO cells.</p>\r\n\r\n<p>In 2015 we have received the GMP authorization from the Italian Regulatory Agency (AIFA, authorization number UAO/103050/P) for the production of the recombinant human BMP4 (Bone Morphogenetic Protein). This protein has obtained the <a href="http://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/orphans/2014/11/human_orphan_001433.jsp&amp;mid=WC0b01ac058001d12b" target="_blank">Orphan Drug designation from EMA</a> for the treatment of glioma.</p>\r\n\r\n<p>The Biotech Dept. is also dedicated to bring innovative oncology products into clinic. We are developing a humanized monoclonal antibody anti-HER2 with groundbreaking features over the actual marketed antibodies for the treatment of HER2 expressing tumors.</p>\r\n\r\n<p>Finally, we have an established production process for the biosimilar eythropoietin alpha.</p>\r\n', 'en'),
(37, 19, '<p>Tutte le attrezzature GMP sono sotto controllo costante e i parametri di funzionamento sono costantemente registrati tramite un sistema convalidato di sensori ed allarmi (TESTO).</p>\r\n\r\n<p><strong>Upstream</strong></p>\r\n\r\n<ul>\r\n	<li>n. 2 wave Bioreactors 20/50 (GE Healthcare)</li>\r\n	<li>n. 1 SIP Bioreactor 30 L (Applikon)</li>\r\n	<li>n. 3 CO2 incubators (Thermo Fisher and Eppendorf-Si41 with integrated shaker)</li>\r\n	<li>n. 2 Liquid nitrogen Dewars (Thermo Fisher and MV2000)</li>\r\n	<li>-80&deg;C, -20&deg;C and +4&deg;C refrigerators</li>\r\n	<li>Nucleocounter per le misure di vitalit&agrave; cellulare</li>\r\n</ul>\r\n\r\n<p><strong>Downstream</strong></p>\r\n\r\n<ul>\r\n	<li>Akta Pilot (GE Healthcare)</li>\r\n	<li>Akta Explorer (GE Healthcare)</li>\r\n	<li>Sartoflow alpha per filtrazione tangenziale</li>\r\n	<li>Inattivazione e rimozione virale</li>\r\n	<li>Hollow fibers (GE Healthcare) per la concentrazione delle proteine</li>\r\n</ul>\r\n\r\n<p><strong>Laboratorio Analisi</strong></p>\r\n\r\n<ul>\r\n	<li>HPLC (Waters)</li>\r\n	<li>UV-Vis spectrophotometer (Perkin Elmer)</li>\r\n	<li>Capillary Electrophoresis (Beckman &amp; Coulter)</li>\r\n	<li>Chemidoc (Bio-Rad)</li>\r\n	<li>ELISA reader (BMG)</li>\r\n	<li>ELISA plate washer (Tecan)</li>\r\n	<li>BioLayerInterferometry (BLITZ-Fortebio)</li>\r\n	<li>Cell-based potency assays</li>\r\n	<li>Real-Time PCR (Applied Biosystems 7500)</li>\r\n	<li>Citofluorimetro (EasyCube-Sysmex)</li>\r\n</ul>\r\n', 'it'),
(38, 19, '<p>All the GMP equipment are under constant and registered control through a validated system of probes and alarms (TESTO).<br />\r\n<br />\r\n<strong>Upstream</strong></p>\r\n\r\n<ul>\r\n	<li>n. 2 wave Bioreactors 20/50 (GE Healthcare)</li>\r\n	<li>n. 1 SIP Bioreactor 30 L (Applikon)</li>\r\n	<li>n. 3 CO2 incubators (Thermo Fisher and Eppendorf-Si41 with integrated shaker)</li>\r\n	<li>n. 2 Liquid nitrogen Dewars (Thermo Fisher and MV2000)</li>\r\n	<li>-80&deg;C, -20&deg;C and +4&deg;C refrigerators</li>\r\n	<li>Nucleocounter for cell counting</li>\r\n</ul>\r\n\r\n<p><strong>Downstream</strong></p>\r\n\r\n<ul>\r\n	<li>Akta Pilot (GE Healthcare)</li>\r\n	<li>Akta Explorer (GE Healthcare)</li>\r\n	<li>Sartoflow alpha for TFF</li>\r\n	<li>Viral Inactivation and Removal</li>\r\n	<li>Hollow fibers (GE Healthcare) for the concentration of proteins</li>\r\n</ul>\r\n\r\n<p><strong>Analysis</strong></p>\r\n\r\n<ul>\r\n	<li>HPLC (Waters)</li>\r\n	<li>UV-Vis spectrophotometer (Perkin Elmer)</li>\r\n	<li>Capillary Electrophoresis (Beckman &amp; Coulter)</li>\r\n	<li>Chemidoc (Bio-Rad)</li>\r\n	<li>ELISA reader (BMG)</li>\r\n	<li>ELISA plate washer (Tecan)</li>\r\n	<li>BioLayerInterferometry (BLITZ-Fortebio)</li>\r\n	<li>Cell-based potency assays</li>\r\n	<li>Real-Time PCR (Applied Biosystems 7500)</li>\r\n	<li>Flow Cytometer (EasyCube-Sysmex)</li>\r\n</ul>\r\n', 'en'),
(39, 20, '<ul>\r\n	<li><strong>Production of recombinant antibodies against ErbB2 for cancer therapy</strong><br />\r\n	&nbsp; &nbsp;(<i>funded by Italian Scientific Research Fund FILAS 2008)</i>&nbsp;</li>\r\n	<li>A breast cancer toolbox: <strong>HER2 targeted immuno-conjugate as therapeutic</strong>&nbsp;<strong>and diagnostic tools</strong> (<a href="https://www.eurostars-eureka.eu/project//id/5995">https://www.eurostars-eureka.eu/project//id/5995</a> <i>&nbsp;funded by Eurostars 2010-2014).</i></li>\r\n	<li><strong>3WAYNEPO: Novel Nanoformulations of low sialic recombinant erythropoietin for treatment of Alzheimer&rsquo;s disease and cerebral ischemia/reperfusion injury.</strong><br />\r\n	(submitted for the H2020 NMBP-10-2016-2017 <i>Proposal number: 720845-1</i>)</li>\r\n</ul>\r\n', 'it'),
(40, 20, '<ul>\r\n	<li><strong>Production of recombinant antibodies against ErbB2 for cancer therapy</strong><br />\r\n	&nbsp; &nbsp;(<i>funded by Italian Scientific Research Fund FILAS 2008)</i>&nbsp;</li>\r\n	<li>A breast cancer toolbox: <strong>HER2 targeted immuno-conjugate as therapeutic</strong>&nbsp;<strong>and diagnostic tools</strong> (<a href="https://www.eurostars-eureka.eu/project//id/5995">https://www.eurostars-eureka.eu/project//id/5995</a> <i>&nbsp;funded by Eurostars 2010-2014).</i></li>\r\n	<li><strong>3WAYNEPO: Novel Nanoformulations of low sialic recombinant erythropoietin for treatment of Alzheimer&rsquo;s disease and cerebral ischemia/reperfusion injury.</strong><br />\r\n	(submitted for the H2020 NMBP-10-2016-2017 <i>Proposal number: 720845-1</i>)<strong><i></i></strong></li>\r\n</ul>\r\n', 'en'),
(41, 21, '<ul>                            <li>Stemgen</li>                            <li>IBA Gmbh</li>                            <li>Sigma-Tau</li>                            <li>IFO-IRE</li>                            <li>Universit√† di Viterbo</li>                            <li>Naxospharma</li>                            <li>Mediapharma																	</li>                          </ul>', 'it'),
(42, 21, '<ul>                            <li>Stemgen</li>                            <li>IBA Gmbh</li>                            <li>Sigma-Tau</li>                            <li>IFO-IRE</li>                            <li>Universit√† di Viterbo</li>                            <li>Naxospharma</li>                            <li>Mediapharma																	</li>                          </ul>', 'en'),
