(45, 23, '<h4><strong>Gastroeneterologia</strong></h4>\r\n\r\n<p>IBI &egrave; presente in gastroenterologia con prodotti per la terapia correlata alla patologia addominale, dispepsia, patologia epatica come calcolosi, colelitiasi, colestasi e altre epatopatie croniche come steatosi e steatoepatite, alla cura della sintomatologia gastrointestinale con prodotti per il miglioramento della peristalsi, del meteorismo e della stipsi.</p>\r\n\r\n<h4><strong>Antibioticoterapia</strong></h4>\r\n\r\n<p>Da numerosi anni IBI &egrave; impegnata nella produzione di materie prime farmacologicamente attive e di specialit&agrave; etiche nel campo dell&rsquo;antibiotico-terapia. In particolare, IBI &egrave; specializzata nella produzione di penicilline sterili iniettabili, che sono esportate in tutto il mondo. La linea antibiotici IBI comprende diversi altri prodotti appartenenti alle classi delle cefalosporine, dei chinoloni, degli aminoglicosidi e dei lincosamidi. Questo settore rappresenta per IBI una tradizione e ne costituisce il core-business. Nell&#39;antibiotico-terapia sono richiesti massimi livelli di qualit&agrave; e un&#39;attenta scelta del prodotto da utilizzare per non incorrere nella resistenza batterica, che &egrave; oggi un serio problema e stimolo ad una costante ricerca. L&#39;alta qualit&agrave; dei prodotti, confermata dalla certificazione delle MAGGIORI autorit&agrave; sanitarie mondiali - FDA (Food and Drug Administration), TGA (Therapeutic Good Administration), MCA (Medicine Control Agency) - ha permesso a IBI di diventare partner privilegiato di importanti realt&agrave; internazionali. Gli antibiotici fanno parte di una classe di farmaci la cui scoperta ed evoluzione costituisce un contributo di grande valore medico-scientifico per l&#39;umanit&agrave;. &Egrave; importante il corretto utilizzo di un antibiotico, che deve essere prescritto e monitorato dal medico, che ne valuta la scelta e reale utilit&agrave; con i mezzi diagnostici e di monitoraggio a sua disposizione.</p>\r\n\r\n<h4><strong>Infiammazione e dolore</strong></h4>\r\n\r\n<p>IBI propone, nella terapia della sintomatologia dolorosa e degli stati infiammatori, un prodotto, a base di ketoprofene, largamente testato per efficacia e rapidit&agrave; d&#39;azione, offrendo un&rsquo;ampia gamma di formulazioni orali, iniettabili e topiche, per le esigenze dei medici e dei pazienti. Inoltre, negli stati di fragilit&agrave; capillare associata all&#39;edema e alla traumatologia minore, IBI mette a disposizione un prodotto a base di ippocastano ben affermato e conosciuto, la cui efficacia &egrave; stata oggetto di diversi studi clinici negli ultimi 30 anni specie nella terapia post operatoria dell&rsquo;edema.</p>\r\n', 'it'),
(46, 23, '<h4><strong>Gastroeneterologia</strong></h4>\r\n\r\n<p>IBI &egrave; presente in gastroenterologia con prodotti per la terapia correlata alla patologia addominale, dispepsia, patologia epatica come calcolosi, colelitiasi, colestasi e altre epatopatie croniche come steatosi e steatoepatite, alla cura della sintomatologia gastrointestinale con prodotti per il miglioramento della peristalsi, del meteorismo e della stipsi.</p>\r\n\r\n<h4><strong>Antibioticoterapia</strong></h4>\r\n\r\n<p>Da numerosi anni IBI &egrave; impegnata nella produzione di materie prime farmacologicamente attive e di specialit&agrave; etiche nel campo dell&rsquo;antibiotico-terapia. In particolare, IBI &egrave; specializzata nella produzione di penicilline sterili iniettabili, che sono esportate in tutto il mondo. La linea antibiotici IBI comprende diversi altri prodotti appartenenti alle classi delle cefalosporine, dei chinoloni, degli aminoglicosidi e dei lincosamidi. Questo settore rappresenta per IBI una tradizione e ne costituisce il core-business. Nell&#39;antibiotico-terapia sono richiesti massimi livelli di qualit&agrave; e un&#39;attenta scelta del prodotto da utilizzare per non incorrere nella resistenza batterica, che &egrave; oggi un serio problema e stimolo ad una costante ricerca. L&#39;alta qualit&agrave; dei prodotti, confermata dalla certificazione delle MAGGIORI autorit&agrave; sanitarie mondiali - FDA (Food and Drug Administration), TGA (Therapeutic Good Administration), MCA (Medicine Control Agency) - ha permesso a IBI di diventare partner privilegiato di importanti realt&agrave; internazionali. Gli antibiotici fanno parte di una classe di farmaci la cui scoperta ed evoluzione costituisce un contributo di grande valore medico-scientifico per l&#39;umanit&agrave;. &Egrave; importante il corretto utilizzo di un antibiotico, che deve essere prescritto e monitorato dal medico, che ne valuta la scelta e reale utilit&agrave; con i mezzi diagnostici e di monitoraggio a sua disposizione.</p>\r\n\r\n<h4><strong>Infiammazione e dolore</strong></h4>\r\n\r\n<p>IBI propone, nella terapia della sintomatologia dolorosa e degli stati infiammatori, un prodotto, a base di ketoprofene, largamente testato per efficacia e rapidit&agrave; d&#39;azione, offrendo un&rsquo;ampia gamma di formulazioni orali, iniettabili e topiche, per le esigenze dei medici e dei pazienti. Inoltre, negli stati di fragilit&agrave; capillare associata all&#39;edema e alla traumatologia minore, IBI mette a disposizione un prodotto a base di ippocastano ben affermato e conosciuto, la cui efficacia &egrave; stata oggetto di diversi studi clinici negli ultimi 30 anni specie nella terapia post operatoria dell&rsquo;edema.</p>\r\n', 'en'),
(47, 24, '<p>Leader nella produzione di antibiotici &beta;-lattamici e di prodotti dedicati alle terapie ospedaliere di urgenza e chirurgiche, <strong>IBI </strong>si &egrave; affidata al marchio <strong>IBISQUS</strong> per una distribuzione diretta negli ospedali in grado di competere a livello internazionale e garantire un&rsquo;alta qualit&agrave; dei servizi offerti.</p>\r\n\r\n<p><strong>IBISQUS </strong>commercializza con competenza e professionalit&agrave; i prodotti IBI in tutte le Strutture Sanitarie a carattere sia Pubblico che Privato ,in <strong>Italia, <a href="http://www.ibisqus-germany.com" target="_blank">Germania</a> e <a href="http://www.bowmed.com" target="_blank">Regno Unito</a></strong>.</p>\r\n\r\n<ul>\r\n	<li>Personale altamente qualificato seleziona i prodotti da partner affidabili garantendone l&rsquo;elevata qualit&agrave;.</li>\r\n	<li>Soluzioni informatiche all&rsquo;avanguardia ne garantiscono una distribuzione efficiente.</li>\r\n	<li>La profonda conoscenza del Canale Ospedaliero di ciascun territorio e dei suoi fabbisogni, gli permette di garantire una fornitura dedicata e continua.</li>\r\n</ul>\r\n\r\n<p>Le competenze professionali, la collaborazione ad ogni livello e l&rsquo;eticit&agrave; sono i valori fondamentali dello spirito del Gruppo che permettono di rispondere alle sfide interne ed esterne in modo rapido ed efficiente.</p>\r\n', 'it'),
(48, 24, '<p>Leader nella produzione di antibiotici &beta;-lattamici e di prodotti dedicati alle terapie ospedaliere di urgenza e chirurgiche, <strong>IBI </strong>si &egrave; affidata al marchio <strong>IBISQUS</strong> per una distribuzione diretta negli ospedali in grado di competere a livello internazionale e garantire un&rsquo;alta qualit&agrave; dei servizi offerti.</p>\r\n\r\n<p><strong>IBISQUS </strong>commercializza con competenza e professionalit&agrave; i prodotti IBI in tutte le Strutture Sanitarie a carattere sia Pubblico che Privato ,in <strong>Italia, <a href="http://www.ibisqus-germany.com" target="_blank">Germania</a> e <a href="http://www.bowmed.com" target="_blank">Regno Unito</a></strong>.</p>\r\n\r\n<ul>\r\n	<li>Personale altamente qualificato seleziona i prodotti da partner affidabili garantendone l&rsquo;elevata qualit&agrave;.</li>\r\n	<li>Soluzioni informatiche all&rsquo;avanguardia ne garantiscono una distribuzione efficiente.</li>\r\n	<li>La profonda conoscenza del Canale Ospedaliero di ciascun territorio e dei suoi fabbisogni, gli permette di garantire una fornitura dedicata e continua.</li>\r\n</ul>\r\n\r\n<p>Le competenze professionali, la collaborazione ad ogni livello e l&rsquo;eticit&agrave; sono i valori fondamentali dello spirito del Gruppo che permettono di rispondere alle sfide interne ed esterne in modo rapido ed efficiente.</p>\r\n', 'en'),
(49, 25, '<p>Ibi &egrave; oggi presente in pi&ugrave; di 30 Paesi con un&rsquo;esportazione di tutta la gamma dei suoi prodotti pari ai 2/3 della produzione. Il mercato estero riveste un ruolo molto importante: le esportazioni infatti sono intorno all&rsquo;80% del fatturato.<br />\r\n<strong>IBI &egrave; presente in EUROPA, NORD AMERICA, AMERICA CENTRALE, ASIA e OCEANIA.</strong></p>\r\n', 'it'),
(50, 25, '<p>Ibi &egrave; oggi presente in pi&ugrave; di 30 Paesi con un&rsquo;esportazione di tutta la gamma dei suoi prodotti pari ai 2/3 della produzione. Il mercato estero riveste un ruolo molto importante: le esportazioni infatti sono intorno all&rsquo;80% del fatturato.<br />\r\n<strong>IBI &egrave; presente in EUROPA, NORD AMERICA, AMERICA CENTRALE, ASIA e OCEANIA.</strong></p>\r\n', 'en'),
