vial for infusion</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<h2>Under Development Dossiers</h2>\r\n\r\n<div class="row">\r\n<div class="license-box">\r\n<div class="col-sm-3">Voriconazole</div>\r\n\r\n<div class="col-sm-9">\r\n<p>200 mg Powder for solution for infusion (2018)</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="license-box">\r\n<div class="col-sm-3">Daptomicina</div>\r\n\r\n<div class="col-sm-9">\r\n<p>350mg Powder for solution for infusion<br />\r\n500mg Powder for solution for infusion</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="license-box">\r\n<div class="col-sm-3">Teicoplanin</div>\r\n\r\n<div class="col-sm-9">\r\n<p>200 mg Powder for solution<br />\r\n400 mg Powder for solution</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="license-box">\r\n<div class="col-sm-3">Tigecycline</div>\r\n\r\n<div class="col-sm-9">\r\n<p>50mg vial</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="license-box">\r\n<div class="col-sm-3">Sodium picosulfate / Magnesium oxide/ citric acid</div>\r\n\r\n<div class="col-sm-9">\r\n<p>Oral granulate</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'en'),
(53, 27, '<h4>Reparto Sintesi Sterile &beta;-lattamico (API)</h4>\r\n\r\n<p><img alt="" class="img-responsive" src="/img/sintesi-lattamico.jpg" style="margin-bottom:20px" /></p>\r\n\r\n<ul>\r\n	<li>Oltre 60 anni di Know-how nei processi di fermentazione e di sintesi di &beta;-lattami</li>\r\n	<li>Processi di Cristallizzazione brevettati</li>\r\n	<li>Impianti e macchinari dedicati e segregate per Penicilline</li>\r\n	<li>Personale altamente specializzato nella produzione in sterile e nei processi di Sintesi</li>\r\n	<li>Alto livello di automazione</li>\r\n	<li>Capacit&agrave; produttiva annua:\r\n	<ul>\r\n		<li>150.000 Kg/Anno per Bulk e Miscele</li>\r\n		<li>1.500.000 Litri/Anno per recupero solventi tramite impianto di distillazione a servizio del reparto</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h4>Ripartizione in asepsi di polveri sterili e liofilizzati &beta;-lattamici</h4>\r\n\r\n<p><img alt="" class="img-responsive" src="/img/ripartizione-asepsi.jpg" style="margin-bottom:20px" /></p>\r\n\r\n<ul>\r\n	<li>Dedicato alle produzioni di polveri sterili &beta;-lattamici (Penicilline)</li>\r\n	<li>Personale altamente specializzato nella produzione in sterile</li>\r\n	<li>Macchine altamente automatizzate</li>\r\n	<li>Reparto dotato di macchine di sperlatura completamente elettronico</li>\r\n	<li>Capacit&agrave; produttiva annua:\r\n	<ul>\r\n		<li>45 Milioni di Flaconcini/anno</li>\r\n		<li>8.100 Kg Liofilizzato/Anno</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h4>Ripartizione di Liquidi Sterili, Orali e Semisolidi non &beta;-lattamici</h4>\r\n\r\n<p><img alt="" class="img-responsive" src="/img/ripartizione-sterili.jpg" style="margin-bottom:20px" /></p>\r\n\r\n<ul>\r\n	<li>Produzione di Forme farmaceutiche solide:\r\n	<ul>\r\n		<li>Granulati</li>\r\n		<li>Compresse rivestite e a rilascio controllato</li>\r\n	</ul>\r\n	</li>\r\n	<li>Produzione di Forme farmaceutiche semi-solide:\r\n	<ul>\r\n		<li>Gel</li>\r\n		<li>Pomate</li>\r\n	</ul>\r\n	</li>\r\n	<li>Produzione di Forme farmaceutiche liquide:\r\n	<ul>\r\n		<li>Gocce</li>\r\n	</ul>\r\n	</li>\r\n	<li>Produzione di soluzioni sterili iniettabili e/o polveri liofilizzate:\r\n	<ul>\r\n		<li>Flaconcini</li>\r\n		<li>Fiale Siringhe</li>\r\n	</ul>\r\n	</li>\r\n	<li>Impianti Multi Scopo e flessibili</li>\r\n	<li>Personale dedicato e qualificato</li>\r\n	<li>Capacit&agrave; annua:\r\n	<ul>\r\n		<li>29 Milioni di Confezioni/Anno</li>\r\n		<li>20 Milioni di Flaconcini e/o Fiale Siringa/Anno</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', 'it'),
