(55, 28, '<h3>About</h3>\r\n\r\n<p>The Biotech Dept. at IBI-Lorenzini is committed to the production of recombinant proteins from CHO cells. In 2015 we have received the GMP authorization from the Italian Regulatory Agency (AIFA, authorization number UAO/103050/P) for the production of the recombinant human BMP4 (Bone Morphogenetic Protein). This protein has obtained the Orphan Drug designation from <a href="http://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/orphans/2014/11/human_orphan_001433.jsp&amp;mid=WC0b01ac058001d12b" target="_blank">EMA</a> for the treatment of glioma. The Biotech Dept. is also dedicated to bring innovative oncology products into clinic. We are developing a humanized monoclonal antibody anti-HER2 with groundbreaking features over the actual marketed antibodies for the treatment of HER2 expressing tumors. Finally, we have an established production process for the biosimilar eythropoietin alpha.</p>\r\n\r\n<p>Equipment</p>\r\n\r\n<p>All the GMP equipment are under constant and registered control through a validated system of probes and alarms (TESTO).<br />\r\n<br />\r\n<strong>Upstream</strong></p>\r\n\r\n<ul>\r\n	<li>n. 2 wave Bioreactors 20/50 (GE Healthcare)</li>\r\n	<li>n. 1 SIP Bioreactor 30 L (Applikon)</li>\r\n	<li>n. 3 CO2 incubators (Thermo Fisher and Eppendorf-Si41 with integrated shaker)</li>\r\n	<li>n. 2 Liquid nitrogen Dewars (Thermo Fisher and MV2000)</li>\r\n	<li>-80&deg;C, -20&deg;C and +4&deg;C refrigerators</li>\r\n	<li>Nucleocounter for cell counting</li>\r\n</ul>\r\n\r\n<p><strong>Downstream</strong></p>\r\n\r\n<ul>\r\n	<li>Akta Pilot (GE Healthcare)</li>\r\n	<li>Akta Explorer (GE Healthcare)</li>\r\n	<li>Sartoflow alpha for TFF</li>\r\n	<li>Viral Inactivation and Removal</li>\r\n	<li>Hollow fibers (GE Healthcare) for the concentration of proteins</li>\r\n</ul>\r\n\r\n<p><strong>Analysis</strong></p>\r\n\r\n<ul>\r\n	<li>HPLC (Waters)</li>\r\n	<li>UV-Vis spectrophotometer (Perkin Elmer)</li>\r\n	<li>Capillary Electrophoresis (Beckman &amp; Coulter)</li>\r\n	<li>Chemidoc (Bio-Rad)</li>\r\n	<li>ELISA reader (BMG)</li>\r\n	<li>ELISA plate washer (Tecan)</li>\r\n	<li>BioLayerInterferometry (BLITZ-Fortebio)</li>\r\n	<li>Cell-based potency assays</li>\r\n	<li>Real-Time PCR (Applied Biosystems 7500)</li>\r\n	<li>Flow Cytometer (EasyCube-Sysmex)</li>\r\n</ul>\r\n\r\n<p>Projects</p>\r\n\r\n<ul>\r\n	<li>Production of recombinant antibodies against ErbB2 for cancer therapy (funded by Italian Scientific Research Fund FILAS 2008)</li>\r\n	<li>A breast cancer toolbox: HER2 targeted immuno-conjugate as therapeutic and diagnostic tools funded by Eurostars 2010-2014 <a href="https://www.eurostars-eureka.eu/project//id/5995" target="_blank">link</a>.</li>\r\n	<li>3WAYNEPO: Novel Nanoformulations of low sialic recombinant erythropoietin for treatment of Alzheimer&rsquo;s disease and cerebral ischemia/reperfusion injury. (submitted for the H2020 NMBP-10-2016-2017 Proposal number: 720845-1)</li>\r\n</ul>\r\n\r\n<p>La IBI valuta possibili collaborazioni con istituzioni accademiche sulla base di progetti promettenti nel campo degli anticorpi monoclonali e delle protein ricombinanti. Offriamo servizi come CMO (Contract Manufacturing Organization) operando:</p>\r\n\r\n<ul>\r\n	<li>Sviluppo di line cellulari CHO e produzione Master e Working Cell Banks pronte per la produzione in GMP;</li>\r\n	<li>Sviluppo di processi upstream e downstream;</li>\r\n	<li>Sviluppo e convalida di metodiche analitiche (chimiche, biochimiche e biologiche).</li>\r\n</ul>\r\n\r\n<p>Le nostre Quality Unit, Qualified Person and Ufficio Regolatorio sono in grado di assistere e portare a termine con successo progetti complessi nel campo delle biotecnologie farmaceutiche.</p>\r\n\r\n<p><strong>Collaborazioni in corso</strong></p>\r\n\r\n<ul>\r\n	<li><a href="http://www.stemgen.net/" target="_blank">Stemgen</a></li>\r\n	<li><a href="https://www.iba-lifesciences.com/home.html" target="_blank">IBA Gmbh</a></li>\r\n	<li><a href="http://www.sigma-tau.it/" target="_blank">Sigma-Tau</a></li>\r\n	<li><a href="http://www.ifo.it/index.html" target="_blank">IFO-IRE</a></li>\r\n	<li><a href="http://www3.unitus.it/" target="_blank">Universit&agrave; di Viterbo</a></li>\r\n	<li><a href="http://www.naxospharma.eu/" target="_blank">Naxospharma</a></li>\r\n	<li><a href="http://www.mediapharma.it/" target="_blank">Mediapharma</a></li>\r\n</ul>\r\n', 'it'),
(56, 28, '<h3>About</h3>\r\n\r\n<p>The Biotech Dept. at IBI-Lorenzini is committed to the production of recombinant proteins from CHO cells. In 2015 we have received the GMP authorization from the Italian Regulatory Agency (AIFA, authorization number UAO/103050/P) for the production of the recombinant human BMP4 (Bone Morphogenetic Protein). This protein has obtained the Orphan Drug designation from <a href="http://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/orphans/2014/11/human_orphan_001433.jsp&amp;mid=WC0b01ac058001d12b" target="_blank">EMA</a> for the treatment of glioma. The Biotech Dept. is also dedicated to bring innovative oncology products into clinic. We are developing a humanized monoclonal antibody anti-HER2 with groundbreaking features over the actual marketed antibodies for the treatment of HER2 expressing tumors. Finally, we have an established production process for the biosimilar eythropoietin alpha.</p>\r\n\r\n<p>Equipment</p>\r\n\r\n<p>All the GMP equipment are under constant and registered control through a validated system of probes and alarms (TESTO).<br />\r\n<br />\r\n<strong>Upstream</strong></p>\r\n\r\n<ul>\r\n	<li>n. 2 wave Bioreactors 20/50 (GE Healthcare)</li>\r\n	<li>n. 1 SIP Bioreactor 30 L (Applikon)</li>\r\n	<li>n. 3 CO2 incubators (Thermo Fisher and Eppendorf-Si41 with integrated shaker)</li>\r\n	<li>n. 2 Liquid nitrogen Dewars (Thermo Fisher and MV2000)</li>\r\n	<li>-80&deg;C, -20&deg;C and +4&deg;C refrigerators</li>\r\n	<li>Nucleocounter for cell counting</li>\r\n</ul>\r\n\r\n<p><strong>Downstream</strong></p>\r\n\r\n<ul>\r\n	<li>Akta Pilot (GE Healthcare)</li>\r\n	<li>Akta Explorer (GE Healthcare)</li>\r\n	<li>Sartoflow alpha for TFF</li>\r\n	<li>Viral Inactivation and Removal</li>\r\n	<li>Hollow fibers (GE Healthcare) for the concentration of proteins</li>\r\n</ul>\r\n\r\n<p><strong>Analysis</strong></p>\r\n\r\n<ul>\r\n	<li>HPLC (Waters)</li>\r\n	<li>UV-Vis spectrophotometer (Perkin Elmer)</li>\r\n	<li>Capillary