(69, 35, '<p>Ibi &egrave; oggi presente in pi&ugrave; di 30 Paesi con un&rsquo;esportazione di tutta la gamma dei suoi prodotti pari ai 2/3 della produzione. Il mercato estero riveste un ruolo molto importante: le esportazioni infatti sono intorno all&rsquo;80% del fatturato.<br />\r\n<strong>IBI &egrave; presente in EUROPA, NORD AMERICA, AMERICA CENTRALE, ASIA e OCEANIA.</strong><a href="http://ibi.dev/admin/singolo-contenuto/1/modifica" target="_blank"><i></i></a></p>\r\n', 'it'),
(70, 35, '<p><strong></strong></p>\r\n\r\n<p>Ibi &egrave; oggi presente in pi&ugrave; di 30 Paesi con un&rsquo;esportazione di tutta la gamma dei suoi prodotti pari ai 2/3 della produzione. Il mercato estero riveste un ruolo molto importante: le esportazioni infatti sono intorno all&rsquo;80% del fatturato.<br />\r\n<strong>IBI &egrave; presente in EUROPA, NORD AMERICA, AMERICA CENTRALE, ASIA e OCEANIA.</strong><a href="http://ibi.dev/admin/singolo-contenuto/1/modifica" target="_blank"><i></i></a><strong></strong></p>\r\n', 'en'),
(71, 36, '<p>Leader nella produzione di antibiotici &beta;-lattamici e di prodotti dedicati alle terapie ospedaliere di urgenza e chirurgiche,&nbsp;<strong>IBI&nbsp;</strong>si &egrave; affidata al marchio&nbsp;<strong>IBISQUS</strong>&nbsp;per una distribuzione diretta negli ospedali in grado di competere a livello internazionale e garantire un&rsquo;alta qualit&agrave; dei servizi offerti.</p>\r\n', 'it'),
(72, 36, '<p>Leader nella produzione di antibiotici &beta;-lattamici e di prodotti dedicati alle terapie ospedaliere di urgenza e chirurgiche,&nbsp;<strong>IBI&nbsp;</strong>si &egrave; affidata al marchio&nbsp;<strong>IBISQUS</strong>&nbsp;per una distribuzione diretta negli ospedali in grado di competere a livello internazionale e garantire un&rsquo;alta qualit&agrave; dei servizi offerti.</p>\r\n', 'en'),
(73, 37, '<h2>Privacy Policy</h2>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (in seguito I.B.I.), tramite il sito www.ibi-lorenzini.it ha come obiettivo la tutela della privacy dei propri utenti e garantisce che il trattamento dei dati personali si svolga nel rispetto dei diritti, delle libert&agrave; fondamentali nonch&eacute; della dignit&agrave; delle persone, con particolare riferimento alla riservatezza e all&#39;identit&agrave; personale. Nel prestare i nostri servizi, entreremo necessariamente in possesso di informazioni e dati personali: intendiamo, perci&ograve;, qui di seguito, illustrare la policy privacy del nostro sito. Il Titolare del trattamento Il Titolare del trattamento dei dati personali trattati a seguito della consultazione del nostro sito, &egrave; I.B.I. S.p.A., con sede in Via Fossignano n&deg;2 Aprilia (LT).</p>\r\n\r\n<p><strong>Il Responsabile del trattamento</strong><br />\r\nIl Responsabile del trattamento &egrave; il Direttore del Personale, domiciliato per la funzione in Via Fossignano n. 2, Aprilia (LT) e l&rsquo;elenco aggiornato degli altri responsabili pu&ograve; essere visionato presso lo stesso.</p>\r\n\r\n<p><strong>Luogo e finalit&agrave; di trattamento dei dati</strong><br />\r\nI trattamenti connessi ai servizi web di questo sito hanno luogo presso la predetta sede della Societ&agrave; e sono curati solo da dipendenti e collaboratori da I.B.I. S.p.A. incaricati del trattamento e da eventuali incaricati di occasionali operazioni di manutenzione. L&#39;invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell&#39;indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva. Sintetiche informative di sintesi verranno progressivamente riportate o visualizzate nelle pagine del sito predisposte per particolari servizi.</p>\r\n\r\n<p><strong>Comunicazione dei dati</strong><br />\r\nI dati forniti dagli utenti non saranno comunicati a soggetti terzi salvo che la comunicazione sia imposta da obblighi di legge o sia strettamente necessario per l&rsquo;adempimento delle richieste. Gli incaricati del trattamento che si occupano della gestione delle richieste, potranno venire a conoscenza dei suoi dati personali esclusivamente per le finalit&agrave; su menzionate.</p>\r\n\r\n<p><strong>Tipi di dati trattati</strong><br />\r\nDati forniti volontariamente dagli utenti L&rsquo;invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell&rsquo;indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva. Sintetiche informative di sintesi verranno progressivamente riportate o visualizzate nelle pagine del sito predisposte per particolari servizi.</p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p><strong>Facoltativit&agrave; del conferimento dei dati</strong><br />\r\nA parte quanto specificato per i dati di navigazione, l&rsquo;utente &egrave; libero di fornire i dati personali per richiedere i servizi offerti dalla societ&agrave;. Il loro mancato conferimento pu&ograve; comportare l&rsquo;impossibilit&agrave; di ottenere il servizio richiesto.</p>\r\n\r\n<p><strong>Modalit&agrave; di trattamento dei dati</strong><br />\r\nI dati personali sono trattati con strumenti manuali e automatizzati, per il tempo necessario a conseguire lo scopo per il quale sono stati raccolti. I dati personali oggetto di trattamento saranno custoditi in modo da ridurre al minimo, mediante l&#39;adozione di idonee e preventive misure di sicurezza, i rischi di distruzione o perdita, anche accidentale, dei dati stessi, di accesso non autorizzato o di trattamento non consentito o non conforme alle finalit&agrave; della raccolta</p>\r\n\r\n<p><strong>Diritti degli interessati</strong><br />\r\nI soggetti cui si riferiscono i dati hanno i diritti previsti dall&rsquo;art. 7 del Codice privacy che riportiamo di seguito:</p>\r\n\r\n<ul>\r\n	<li>L&#39;interessato ha diritto di ottenere la conferma dell&#39;esistenza o meno di dati personali che lo riguardano, anche se non ancora registrati, e la loro comunicazione in forma intelligibile.</li>\r\n	<li>L&#39;interessato ha diritto di ottenere:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) dell&#39;origine dei dati personali;</li>\r\n		<li>&nbsp; &nbsp; b) delle finalit&agrave; e modalit&agrave; del trattamento;</li>\r\n		<li>&nbsp; &nbsp; c) della logica applicata in caso di trattamento effettuato con l&#39;ausilio di strumenti elettronici;</li>\r\n		<li>&nbsp; &nbsp; d) degli estremi identificativi del titolare, dei responsabili e del rappresentante designato ai sensi dell&#39;articolo 5, comma 2;</li>\r\n		<li>&nbsp; &nbsp; e) dei soggetti o delle categorie di soggetti ai quali i dati personali possono essere comunicati o che possono venirne a conoscenza in qualit&agrave; di rappresentante designato nel territorio dello Stato, di responsabili o incaricati.</li>\r\n	</ul>\r\n	</li>\r\n	<li>L&#39;interessato ha diritto di ottenere:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) l&#39;aggiornamento, la rettificazione ovvero, quando vi ha interesse, l&#39;integrazione dei dati;</li>\r\n		<li>&nbsp; &nbsp; b) la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, compresi quelli di cui non &egrave; necessaria la conservazione in relazione agli scopi per i quali i dati sono stati raccolti o successivamente trattati;</li>\r\n		<li>&nbsp; &nbsp; c) l&#39;attestazione che le operazioni di cui alle lettere a) e b) sono state portate a conoscenza, anche per quanto riguarda il loro contenuto, di coloro ai quali i dati sono stati comunicati o diffusi, eccettuato il caso in cui tale adempimento si rivela impossibile o comporta un impiego di mezzi manifestamente sproporzionato rispetto al diritto tutelato.</li>\r\n	</ul>\r\n	</li>\r\n	<li>L&#39;interessato ha diritto di opporsi, in tutto o in parte:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) per motivi legittimi al trattamento dei dati personali che lo riguardano, ancorch&egrave; pertinenti allo scopo della raccolta;</li>\r\n		<li>&nbsp; &nbsp; b) al trattamento di dati personali che lo riguardano a fini di invio di materiale pubblicitario o di vendita diretta o per il compimento di ricerche di mercato o di comunicazione commerciale.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Informativa D.Lgs 196/2003</p>\r\n\r\n<p>Codice in materia di protezione dei dati personali</p>\r\n\r\n<p>Il D.Lgs 196/2003 (Codice in materia di protezione dei dati personali), impone particolari cautele e rigorosi adempimenti, allo scopo di garantire che il trattamento dei dati personali si svolga nel rispetto dei diritti, delle libert&agrave; fondamentali, nonch&eacute; della dignit&agrave; delle persone fisiche, con particolare riguardo alla riservatezza e all&rsquo;identit&agrave; personale. In ottemperanza alla predetta Legge ed in particolare a quanto disposto dall&#39;articolo 13, La informiamo di quanto segue.</p>\r\n\r\n<ul>\r\n	<li>Il trattamento dei dati personali, da lei forniti inserendo le informazioni nei campi sotto evidenziati e che verranno inseriti nella banca dati &quot;Anagrafica Medici&quot;, &egrave; finalizzato:\r\n	<ul>\r\n		<li>Allo svolgimento di attivit&agrave; di informazione scientifica su medicinali per uso umano. L&#39;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (in seguito anche I.B.I.) svolge detta attivit&agrave; nel rispetto di quanto previsto dalla normativa vigente con particolare, ma non esclusivo, riferimento al Decreto legislativo 30.12.1992 n. 541, cos&igrave; come successivamente modificato ed emendato. Date le finalit&agrave; perseguite dall&#39;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A., si precisa che il trattamento non ha per oggetto dati sensibili. Il conferimento dei dati per l&rsquo;attivit&agrave; di informazione scientifica &egrave; necessario e in mancanza del consenso non si potr&agrave; dare seguito alla finalit&agrave; su menzionata.</li>\r\n		<li>All&rsquo;invio di inviti o segnalazioni di congressi, convegni, seminari, comunicazioni relative ad iniziative promosse o sponsorizzate da I.B.I., invio di pubblicazioni periodiche od occasionali, informazioni su nuovi prodotti, metodologie, servizi. Tali attivit&agrave; potranno essere realizzate attraverso e-mail, fax, SMS, posta cartacea o contatto telefonico.&nbsp; Il conferimento dei dati per tale finalit&agrave; &egrave; facoltativo e senza il suo consenso non saranno trasmesse le informazioni ivi menzionate.</li>\r\n	</ul>\r\n	</li>\r\n	<li>I suoi dati non saranno diffusi ma potranno essere comunicati a persone, societ&agrave;, associazioni o studi professionali che prestino servizi o attivit&agrave; di assistenza e/o consulenza a I.B.I., alla rete di informatori medico-scientifici, ai nostri fornitori ed eventuali subfornitori all&#39;uopo incaricati e ove impegnati nell&rsquo;esecuzione di attivit&agrave; connesse con le finalit&agrave; sopra indicate, a societ&agrave; di mailing e di indagini statistiche o per invio di documentazione scientifica e a soggetti cui la facolt&agrave; di accedere ai dati sia riconosciuta da disposizioni di legge e/o di normativa secondaria.</li>\r\n	<li>Gli incaricati potranno venire a conoscenza dei suoi dati personali esclusivamente per le finalit&agrave; su menzionate.</li>\r\n	<li>Il Titolare del Trattamento &egrave; l&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. con sede legale in Via Fossignano 2, Aprilia (LT). Il Responsabile del trattamento &egrave; il responsabile della direzione medica, domiciliato per la funzione presso la sede legale della societ&agrave;; l&rsquo;elenco aggiornato degli altri Responsabili potr&agrave; essere visionato presso l&rsquo;ufficio del personale dell&rsquo;azienda.</li>\r\n	<li>La informiamo infine che potr&agrave; esercitare i diritti contemplati dall&#39;articolo 7 del Decreto Legislativo 196/03 tra cui quello di ottenere, dal Titolare o dal Responsabile, la conferma dell&rsquo;esistenza o meno di Suoi Dati personali e di &nbsp;consentirle, nel caso, la messa a disposizione. Lei potr&agrave; pertanto chiedere di avere conoscenza dell&rsquo;origine dei dati nonch&eacute; della logica e delle finalit&agrave; del Trattamento; di ottenere la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, nonch&eacute; l&rsquo;aggiornamento, la rettifica o, se vi &egrave; interesse, l&rsquo;integrazione dei dati stessi; di opporsi per motivi legittimi al trattamento oppure opporsi in parte al trattamento degli stessi (per esempio opponendosi ad una o pi&ugrave; delle modalit&agrave; di contatto indicate nel punto b della presente informativa). Lei potr&agrave; esercitare tali diritti scrivendo a: Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. Via Fossignano, 2 - 04011 Aprilia (LT); oppure a <a href="mailto:info@ibi-lorenzini.com">info@ibi-lorenzini.com</a>.</li>\r\n</ul>\r\n\r\n<p><strong>Per le Informazioni sul profilo utente</strong><br />\r\nL&rsquo;uso della password &egrave; strettamente personale e questa non deve essere divulgata. Dichiaro di aver preso visione delle norme di cui al D. Lgs. 30.12.1992 n. 541 e che le informazioni sono reali. Preso atto del contenuto dell&rsquo;Informativa D.Lgs. 196/2003 (Codice in materia di protezione dei dati personali) acconsento espressamente, ai sensi dell&rsquo;art. 23.</p>\r\n\r\n<p><strong>Cookies policy</strong><br />\r\nIbi Lorenzini informa che utilizza cookies tecnici e cookies di terze parti quando gli utenti navigano attraverso le pagine del suo sito web www.ibi-lorenzini.com. La presente policy fornisce informazioni su cosa sono i cookies, su quali cookies utilizza Ibi Lorenzini e su come disattivare i cookies dal browser utilizzato per la navigazione.&nbsp;<br />\r\n<br />\r\nSe si sceglie di utilizzare questo sito senza bloccare o disabilitare i cookies o di optare per altre tecnologie, si indica il consenso al nostro uso di tali cookies. Se non si acconsente all&rsquo;utilizzo di queste tecnologie, si prega di essere sicuri di bloccarle o disattivarle utilizzando le impostazioni del browser.</p>\r\n\r\n<p><strong>Che cosa sono i cookies</strong><br />\r\nI &quot;cookies&quot; sono piccoli file di testo che un server pu&ograve; salvare sul disco rigido di un computer e che possono memorizzare alcune informazioni sull&#39;utente. I cookies consentono al sito web di registrare l&#39;attivit&agrave; dell&rsquo;utente e di memorizzare le sue preferenze. I cookies aiutano ad analizzare l&rsquo;interazione tra l&#39;utente e il sito web e consentono una navigazione pi&ugrave; fluida e personalizzata.</p>\r\n\r\n<p><strong>Quali tipi di cookies esistono</strong><br />\r\nIn base alla sua durata un cookie pu&ograve; essere classificato come &quot;di sessione&quot; o &quot;permanente&quot;.&nbsp;<br />\r\nI cookies &quot;di sessione&quot; sono temporanei e scompaiono dal computer quando l&#39;utente lascia il sito visitato o chiudere il browser. Solitamente vengono memorizzati nella memoria cache del computer.&nbsp;<br />\r\nI cookies &quot;permanenti&quot; rimangono nel computer dell&#39;utente anche dopo la chiusura browser e fino alla loro scadenza o fino a quando l&#39;utente li elimina. La data di scadenza &egrave; determinata dal sito che li avvia. Sono spesso utilizzati per tracciare le abitudini dell&rsquo;utente, in modo che quando l&#39;utente rivisita il sito, questo legge le informazioni memorizzate e si adatta alle sue preferenze.</p>\r\n\r\n<p><strong>Che cookies utilizza ibi Lorenzini</strong><br />\r\nIbi Lorenzini utilizza cookies esterni generati nelle pagine web da terze parti e cookie tecnici di sessione.<br />\r\nDi seguito una lista dei cookies utilizzati da ibi-lorenzini.com.&nbsp;</p>\r\n\r\n<p><strong>Cookies tecnici</strong><br />\r\nIbi Lorenzini utilizza cookies tecnici per salvare la sessione e memorizzare le credenziali degli utenti abilitati ad accedere al pannello di controllo del sito.<br />\r\n<br />\r\n<strong>Cookies di terze parti</strong><br />\r\nGoogle Maps:<br />\r\nIbi Lorenzini utilizza cookies di Google Maps che sono necessari per il funzionamento delle mappe dinamiche. Il contenuto e la loro creazione non sono direttamente controllabili poich&eacute; generati automaticamente all&#39;inclusione della mappa dinamica. Su alcune pagine sono presenti mappe interattive fornite da Google, che potrebbe installare cookies per rilevare informazioni e preferenze relative a questo servizio. Per maggiori informazioni sull&rsquo;utilizzo dei cookies da parte di Google, consultare la privacy policy di Google:&nbsp;<a href="http://www.google.com/intl/it/policies/privacy" target="_blank">http://www.google.com/intl/it/policies/privacy</a>&nbsp;</p>\r\n\r\n<p>Google Analytics:<br />\r\nIbi Lorenzini utilizza Google Analytics, un servizio di Web analytics fornito da Google, Inc.. Google Analytics fa uso dei cosiddetti &quot;cookies&quot;, file di testo che vengono memorizzati sul computer degli utenti e che permettono l&rsquo;analisi dell&rsquo;utilizzo della piattaforma da parte dell&rsquo;utente.&nbsp;<a href="https://developers.google.com/analytics/devguides/collection/analyticsjs/cookie-usage" target="_blank">Per maggiori informazioni tecniche</a>. Le informazioni generate dai cookie sull&rsquo;attivit&agrave; dell&#39;utente su questo sito vengono normalmente trasferite e immagazzinate su un server di Google negli Stati Uniti. Per conto di Ibi Lorenzini, Google elaborer&agrave; queste informazioni per monitorare l&rsquo;utilizzo del sito, generare report sulle attivit&agrave; compiute sul sito e fornire ulteriori servizi connessi all&rsquo;utilizzo di internet e del sito. L&rsquo;indirizzo IP del browser dell&rsquo;utente rilevato da Google Analytics non verr&agrave; combinato a nessun altro dato in possesso di Google. E&rsquo; possibile disattivare l&rsquo;utilizzo dei cookie selezionando, sul tuo browser, le impostazioni che consentono di rifiutarli. Inoltre, puoi impedire la raccolta e l&rsquo;elaborazione dei dati generati dai cookie sull&rsquo;utilizzo di questo sito (incluso il tuo indirizzo IP)&nbsp;<a href="https://tools.google.com/dlpage/gaoptout?hl=it" target="_blank">scaricando e installando il seguente plug-in sul tuo browser.</a><br />\r\n<strong><br />\r\nDisabilitare i cookies</strong><br />\r\n&Egrave; possibile configurare il browser utilizzato per la navigazione per eliminare o per impedire l&#39;installazione di cookies. L&#39;utente pu&ograve; controllare quali cookies sono istallati, qual &egrave; la loro durata ed eliminarli. I passaggi per eseguire queste operazioni differisco da browser a browser. Qui di seguito le guide per i browser pi&ugrave; diffusi:</p>\r\n\r\n<ul>\r\n	<li><a href="https://support.google.com/chrome/answer/95647?hl=it" target="_blank">Chrome</a></li>\r\n	<li><a href="http://windows.microsoft.com/it-it/internet-explorer/delete-manage-cookies#ie=ie-10" target="_blank">Internet Explorer</a></li>\r\n	<li><a href="https://support.mozilla.org/it/kb/Eliminare%20i%20cookie" target="_blank">Mozilla Firefox</a></li>\r\n	<li><a href="http://www.opera.com/help/tutorials/security/privacy/" target="_blank">Opera</a></li>\r\n	<li><a href="https://support.apple.com/kb/PH19214?viewlocale=it_IT&amp;locale=en_US" target="_blank">Safari</a></li>\r\n</ul>\r\n\r\n<div><!--[endif]--></div>\r\n', 'it');
INSERT INTO `contenuti_translations` (`id`, `contenuti_id`, `testo`, `locale`) VALUES
(74, 37, '<h2>Privacy Policy</h2>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (in seguito I.B.I.), tramite il sito www.ibi-lorenzini.it ha come obiettivo la tutela della privacy dei propri utenti e garantisce che il trattamento dei dati personali si svolga nel rispetto dei diritti, delle libert&agrave; fondamentali nonch&eacute; della dignit&agrave; delle persone, con particolare riferimento alla riservatezza e all&#39;identit&agrave; personale. Nel prestare i nostri servizi, entreremo necessariamente in possesso di informazioni e dati personali: intendiamo, perci&ograve;, qui di seguito, illustrare la policy privacy del nostro sito. Il Titolare del trattamento Il Titolare del trattamento dei dati personali trattati a seguito della consultazione del nostro sito, &egrave; I.B.I. S.p.A., con sede in Via Fossignano n&deg;2 Aprilia (LT).</p>\r\n\r\n<p><strong>Il Responsabile del trattamento</strong><br />\r\nIl Responsabile del trattamento &egrave; il Direttore del Personale, domiciliato per la funzione in Via Fossignano n. 2, Aprilia (LT) e l&rsquo;elenco aggiornato degli altri responsabili pu&ograve; essere visionato presso lo stesso.</p>\r\n\r\n<p><strong>Luogo e finalit&agrave; di trattamento dei dati</strong><br />\r\nI trattamenti connessi ai servizi web di questo sito hanno luogo presso la predetta sede della Societ&agrave; e sono curati solo da dipendenti e collaboratori da I.B.I. S.p.A. incaricati del trattamento e da eventuali incaricati di occasionali operazioni di manutenzione. L&#39;invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell&#39;indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva. Sintetiche informative di sintesi verranno progressivamente riportate o visualizzate nelle pagine del sito predisposte per particolari servizi.</p>\r\n\r\n<p><strong>Comunicazione dei dati</strong><br />\r\nI dati forniti dagli utenti non saranno comunicati a soggetti terzi salvo che la comunicazione sia imposta da obblighi di legge o sia strettamente necessario per l&rsquo;adempimento delle richieste. Gli incaricati del trattamento che si occupano della gestione delle richieste, potranno venire a conoscenza dei suoi dati personali esclusivamente per le finalit&agrave; su menzionate.</p>\r\n\r\n<p><strong>Tipi di dati trattati</strong><br />\r\nDati forniti volontariamente dagli utenti L&rsquo;invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell&rsquo;indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva. Sintetiche informative di sintesi verranno progressivamente riportate o visualizzate nelle pagine del sito predisposte per particolari servizi.</p>\r\n\r\n<p><strong>Facoltativit&agrave; del conferimento dei dati</strong><br />\r\nA parte quanto specificato per i dati di navigazione, l&rsquo;utente &egrave; libero di fornire i dati personali per richiedere i servizi offerti dalla societ&agrave;. Il loro mancato conferimento pu&ograve; comportare l&rsquo;impossibilit&agrave; di ottenere il servizio richiesto.</p>\r\n\r\n<p><strong>Modalit&agrave; di trattamento dei dati</strong><br />\r\nI dati personali sono trattati con strumenti manuali e automatizzati, per il tempo necessario a conseguire lo scopo per il quale sono stati raccolti. I dati personali oggetto di trattamento saranno custoditi in modo da ridurre al minimo, mediante l&#39;adozione di idonee e preventive misure di sicurezza, i rischi di distruzione o perdita, anche accidentale, dei dati stessi, di accesso non autorizzato o di trattamento non consentito o non conforme alle finalit&agrave; della raccolta</p>\r\n\r\n<p><strong>Diritti degli interessati</strong><br />\r\nI soggetti cui si riferiscono i dati hanno i diritti previsti dall&rsquo;art. 7 del Codice privacy che riportiamo di seguito:</p>\r\n\r\n<ul>\r\n	<li>L&#39;interessato ha diritto di ottenere la conferma dell&#39;esistenza o meno di dati personali che lo riguardano, anche se non ancora registrati, e la loro comunicazione in forma intelligibile.</li>\r\n	<li>L&#39;interessato ha diritto di ottenere:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) dell&#39;origine dei dati personali;</li>\r\n		<li>&nbsp; &nbsp; b) delle finalit&agrave; e modalit&agrave; del trattamento;</li>\r\n		<li>&nbsp; &nbsp; c) della logica applicata in caso di trattamento effettuato con l&#39;ausilio di strumenti elettronici;</li>\r\n		<li>&nbsp; &nbsp; d) degli estremi identificativi del titolare, dei responsabili e del rappresentante designato ai sensi dell&#39;articolo 5, comma 2;</li>\r\n		<li>&nbsp; &nbsp; e) dei soggetti o delle categorie di soggetti ai quali i dati personali possono essere comunicati o che possono venirne a conoscenza in qualit&agrave; di rappresentante designato nel territorio dello Stato, di responsabili o incaricati.</li>\r\n	</ul>\r\n	</li>\r\n	<li>L&#39;interessato ha diritto di ottenere:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) l&#39;aggiornamento, la rettificazione ovvero, quando vi ha interesse, l&#39;integrazione dei dati;</li>\r\n		<li>&nbsp; &nbsp; b) la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, compresi quelli di cui non &egrave; necessaria la conservazione in relazione agli scopi per i quali i dati sono stati raccolti o successivamente trattati;</li>\r\n		<li>&nbsp; &nbsp; c) l&#39;attestazione che le operazioni di cui alle lettere a) e b) sono state portate a conoscenza, anche per quanto riguarda il loro contenuto, di coloro ai quali i dati sono stati comunicati o diffusi, eccettuato il caso in cui tale adempimento si rivela impossibile o comporta un impiego di mezzi manifestamente sproporzionato rispetto al diritto tutelato.</li>\r\n	</ul>\r\n	</li>\r\n	<li>L&#39;interessato ha diritto di opporsi, in tutto o in parte:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) per motivi legittimi al trattamento dei dati personali che lo riguardano, ancorch&egrave; pertinenti allo scopo della raccolta;</li>\r\n		<li>&nbsp; &nbsp; b) al trattamento di dati personali che lo riguardano a fini di invio di materiale pubblicitario o di vendita diretta o per il compimento di ricerche di mercato o di comunicazione commerciale.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Information on law D.Lgs 196/2003</p>\r\n\r\n<p>Code for the protection of personal data</p>\r\n\r\n<p>The law D.Lgs 196/2003 (Code for the protection of personal data) imposes great caution and strict fulfillment in order to guarantee treatment of private data in respect of the rights, basic freedom and dignity of individuals with particular attention to confidentiality and personal identity. In compliance with the above-mentioned law and as provided for article 13, we give you the following information.</p>\r\n\r\n<ul>\r\n	<li>The treatment of your personal data, supplied by you in the following form and signed for acceptance will be inserted in the data bank &ldquo;Personal Data Doctors&rdquo;, and has the sole aim of:\r\n	<ul>\r\n		<li>carrying out activities of scientific information regarding medicines for human use. Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. carries out these activities in respect with the laws in force with particular but not exclusive reference to the law D.L 30.12.1992 n. 541, and its subsequent modifications and amendments. Considering the stated purposes of Istituto Biochimico Italiano Giovanni Lorenzini S.p.A., it is important to mention that the treatment does not regard sensitive data. Data processing for scientific information is necessary and in the absence of consent to the use of personal data Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. will not be able to follow up on above mentioned purpose.</li>\r\n		<li>Invitations or notifications of congresses, conferences, seminars, and communications about initiatives promoted or sponsored by Istituto Biochimico Italiano Giovanni Lorenzini S.p.A., mailing of periodic or occasional publications, information about new products, methodologies, services. These activities may be carried out through e-mail, fax, SMS, letters or telephone contact. Data processing for such purposes is optional and in the absence of consent to the use of personal data the above mentioned information will not be communicated.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Your data will not be disclosed but may be communicated to people, companies, associations or professional offices that provide services or assistance and/or advice to Istituto Biochimico Italiano Giovanni Lorenzini S.p.A., to the network of pharmaceutical representatives, to our suppliers and any subcontractors, charged for this purpose and involved in the execution of activities related to the above mentioned objects, to mailing companies and statistical surveys or for scientific documentation posting and to individuals who are authorized to access the data, under provisions of the law and/or secondary legislation.</li>\r\n	<li>People in charge may be aware of your personal data exclusively for the above mentioned purposes.</li>\r\n	<li>The owner of your personal data is Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. with legal head office at Via Fossignano n. 2, Aprilia (LT). The person in charge of your personal data is the manager of the Medical Direction, with business address at the registered office of the company. The updated list of other managers may be consulted at the Human Resources office of the company.</li>\r\n	<li>You can exercise the rights provided by Article 7 of Legislative Decree 196/03 including obtaining, from the Holder or from the Manager responsible for the treatment of data, confirmation of the existence or not of your personal data and allowing making them available. You will therefore be able to ask for the origin of the data and the logic and the purpose of handling; to obtain cancellation, transformation into anonymity or to block data in violation of the law as well as updating, correction or, if there is interest, integration of data; to oppose for legal reasons to the treatment of data or oppose partially to their treatment (for example, by opposing to one or more of the contact methods listed in point b of this information). You can exercise the rights listed above writing to: Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. Via Fossignano, 2 - 04011 Aprilia (LT); or writing an e-mail to info@ibi-lorenzini.com.</li>\r\n</ul>\r\n\r\n<p><strong>For information about the user profile</strong><br />\r\nThe use of password is strictly personal and it should not be divulged to third parties. I confirm that I read the rules of Legislative Decree 30/12/1992 n. 541 and I confirm that information are real. I acknowledge of the contents of the Legislative Decree no. 196/2003 (Code concerning the protection of personal data) and I clearly agree to art. 23 of Legislative Decree no. 196/2003, to the processing by Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. of my personal data that I spontaneously provided, filling the fields mentioned above, for the purposes and within the limits mentioned in this statement.</p>\r\n\r\n<p><strong>Cookie Policy</strong><br />\r\nIf you choose to use this website without blocking or disabling cookies or opting out of other technologies, you will indicate your consent to our use of these cookies. If you do not consent to the use of these technologies, please be sure to block or disable them using your browser settings.</p>\r\n\r\n<p><strong>What are cookies?</strong><br />\r\nCookies are small text files that are placed on your computer by websites that you visit. These text files can be read by these websites and help to identify you when you return to a website. Cookies can be &ldquo;persistent&rdquo; or &ldquo;session&rdquo; cookies. Persistent cookies remain on your computer when you have gone offline, while session cookies are deleted as soon as you close your web browser.&nbsp;<br />\r\n<br />\r\nThere are two main kinds of cookies: session cookies and persistent cookies. Session cookies are deleted from your computer when you close your browser, whereas persistent cookies remain stored on your computer until deleted, or until they reach their expiry date.</p>\r\n\r\n<p><strong>Which cookies do we use?</strong></p>\r\n\r\n<p><strong></strong><strong>Technical cookies</strong><br />\r\nIbi Lorenzini uses technical cookies&nbsp;to store login information of users who have access to the site&#39;s control panel.</p>\r\n\r\n<p><br />\r\n<strong>Third parties cookies</strong><br />\r\nGoogle maps:<strong></strong><br />\r\nIbi Lorenzini uses Google Maps cookies for the creation and the operation of dynamic maps. The content and the creation of Google Maps cookies are not directly controllable by Ibi Lorenzini, as well as the inclusion of automatically generated dynamic maps within some of the Site&rsquo;s pages. Through Google Maps, Google may use cookies to collect information and preferences for this service.<br />\r\nFor more information about cookies from Google, please see their Privacy Policy available at:&nbsp;<a href="http://www.google.com/intl/it/policies/privacy">http://www.google.com/intl/it/policies/privacy</a></p>\r\n\r\n<p><strong></strong><br />\r\nGoogle analytics:<br />\r\nGoogle Analytics is a web analytics service provided by Google, Inc. (&ldquo;Google&rdquo;), to help us see how our website is used. In doing so information about your use of our website, may be transmitted to Google and stored on servers in the United States. The data collected by Google Analytics is used to analyse how frequently the same people revisit the website, how the website is found (from advertising or referring websites), and which pages are most frequently viewed. This information is combined with data from thousands of other users to create an overall picture of website use, and is never identified individually or personally and is not linked to any other information we store about you.<br />\r\nFor more information about cookies from Google, please see the privacy policy of Google:<a href="http://www.google.com/intl/it/policies/privacy" target="_blank">http://www.google.com/intl/it/policies/privacy</a><br />\r\n<br />\r\n<strong>Disabling cookies</strong><br />\r\nYou can block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. Below are links to the &#39;Help&#39; pages of major browsers which explain how you can do this. However, if you use your browser settings to block all cookies (including essential cookies) you may not be able to access all or parts of our site or any other websites that you visit.&nbsp;<br />\r\n<br />\r\n<a href="https://support.google.com/chrome/answer/95647?hl=en" target="_blank">Chrome</a><br />\r\n<a href="http://windows.microsoft.com/it-it/internet-explorer/delete-manage-cookies#ie=ie-10" target="_blank">Internet Explorer</a><br />\r\n<a href="https://support.mozilla.org/en-US/kb/delete-cookies-remove-info-websites-stored" target="_blank">Mozilla Firefox</a><br />\r\n<a href="http://www.opera.com/help/tutorials/security/privacy/" target="_blank">Opera</a><br />\r\n<a href="https://support.apple.com/kb/PH19214?viewlocale=en_US&amp;locale=en_US" target="_blank">Safari</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><!--[endif]--></div>\r\n', 'en'),
