bambini gocce orali, sospensione La posologia suggerita per i bambini &egrave; di 15 gocce, 2-4 volte al d&igrave;, dopo i pasti o secondo prescrizione medica</p>\r\n', 'en'),
(91, 46, '<p>La steatosi epatica non alcolica o NAFLD (Non Alcoholic Fatty Liver Disease) &egrave; la pi&ugrave; comune causa di malattia cronica del fegato nei paesi occidentali. La malattia &egrave; caratterizzata dall&rsquo;accumulo di grasso nel fegato (NAFL), in particolare di trigliceridi all&rsquo;interno delle cellule (epatociti), e pu&ograve; evolvere in steatoepatite o NASH (Non Alcoholic Steato-Hepatitis) e si caratterizza per la presenza, oltre ai depositi di grasso, per una reazione necro-infiammatoria. Quando invece la steatoepatite &egrave; correlata principalmente ad una assunzione elevata di alcol viene definita ASH (Alcoholic Steato-Hepatitis).</p>\r\n', 'it'),
(92, 46, '<p>La steatosi epatica non alcolica o NAFLD (Non Alcoholic Fatty Liver Disease) &egrave; la pi&ugrave; comune causa di malattia cronica del fegato nei paesi occidentali. La malattia &egrave; caratterizzata dall&rsquo;accumulo di grasso nel fegato (NAFL), in particolare di trigliceridi all&rsquo;interno delle cellule (epatociti), e pu&ograve; evolvere in steatoepatite o NASH (Non Alcoholic Steato-Hepatitis) e si caratterizza per la presenza, oltre ai depositi di grasso, per una reazione necro-infiammatoria. Quando invece la steatoepatite &egrave; correlata principalmente ad una assunzione elevata di alcol viene definita ASH (Alcoholic Steato-Hepatitis).</p>\r\n', 'en'),
(93, 47, '<p>La Steatosi epatica non alcolica &egrave; presente nel 10-25% della popolazione generale, quindi in media 1 italiano su 4 ne soffre; tali percentuali aumentano in modo significativo nei pazienti obesi, fino a valori del 50-90%. L&rsquo;entit&agrave; di questo problema non &egrave; da sottovalutare, non solo perch&eacute; la percentuale di obesi nel nostro paese &egrave; significativa (18%) ma soprattutto perch&eacute; si osserva da anni un trend di progressivo aumento (vedi confronto tra anni &rsquo;90 e primi anni del 2000 con un aumento degli obesi dal 10 al 18%, ovviamente associato anche ad un aumento del numero delle persone in sovrappeso).</p>\r\n\r\n<p><img class="img-responsive" src="http://placehold.it/750x350" /></p>\r\n\r\n<p>La steatosi, se si attuano le opportune misure eliminando le cause che l&rsquo;hanno prodotta, &egrave; un danno stabile o reversibile. Purtroppo, essendo un danno iniziale, non facilmente diagnosticabile per la mancanza di segni e sintomi clinici evidenti, pu&ograve; evolvere in steatoepatite. La Steatoepatite &egrave; presente nel 5-10% dei pazienti con NAFLD e si instaura per la costante presenza delle cause/fattori di rischio che hanno condotto alla NAFLD. Tali cause/fattori di rischio sono legate principalmente ad una non corretta alimentazione e allo stile di vita, fattori che inevitabilmente portano ad obesit&agrave;, ipercolesterolemia, ipertrigliceridemia, insulino-resistenza e diabete tipo 2. Oltre queste cause/fattori di rischio pi&ugrave; comuni la NAFLD si riscontra in seguito a farmaci assunti cronicamente o tossici per il fegato, diete ipocaloriche drastiche non bilanciate, disordini metabolici ereditari, danno intestinale. Non ultima causa di NAFLD &egrave; l&rsquo;epatite da virus C. La steatoepatite progredisce pi&ugrave; o meno lentamente verso la fibrosi e la cirrosi. Inoltre, &egrave; spesso associata a un aumentato rischio di malattia cardiovascolare e diabete mellito di tipo 2. Negli ultimi anni si sta valutando attentamente quanti pazienti affetti dall&rsquo;epatopatia cronica possano andare incontro all&#39; epatocarcinoma, senza necessariamente avere una cirrosi, legata ai virus dell&rsquo;epatite virale C.</p>\r\n', 'it'),
(94, 47, '<p>La Steatosi epatica non alcolica &egrave; presente nel 10-25% della popolazione generale, quindi in media 1 italiano su 4 ne soffre; tali percentuali aumentano in modo significativo nei pazienti obesi, fino a valori del 50-90%. L&rsquo;entit&agrave; di questo problema non &egrave; da sottovalutare, non solo perch&eacute; la percentuale di obesi nel nostro paese &egrave; significativa (18%) ma soprattutto perch&eacute; si osserva da anni un trend di progressivo aumento (vedi confronto tra anni &rsquo;90 e primi anni del 2000 con un aumento degli obesi dal 10 al 18%, ovviamente associato anche ad un aumento del numero delle persone in sovrappeso).</p>\r\n\r\n<p><img class="img-responsive" src="http://placehold.it/750x350" /></p>\r\n\r\n<p>La steatosi, se si attuano le opportune misure eliminando le cause che l&rsquo;hanno prodotta, &egrave; un danno stabile o reversibile. Purtroppo, essendo un danno iniziale, non facilmente diagnosticabile per la mancanza di segni e sintomi clinici evidenti, pu&ograve; evolvere in steatoepatite. La Steatoepatite &egrave; presente nel 5-10% dei pazienti con NAFLD e si instaura per la costante presenza delle cause/fattori di rischio che hanno condotto alla NAFLD. Tali cause/fattori di rischio sono legate principalmente ad una non corretta alimentazione e allo stile di vita, fattori che inevitabilmente portano ad obesit&agrave;, ipercolesterolemia, ipertrigliceridemia, insulino-resistenza e diabete tipo 2. Oltre queste cause/fattori di rischio pi&ugrave; comuni la NAFLD si riscontra in seguito a farmaci assunti cronicamente o tossici per il fegato, diete ipocaloriche drastiche non bilanciate, disordini metabolici ereditari, danno intestinale. Non ultima causa di NAFLD &egrave; l&rsquo;epatite da virus C. La steatoepatite progredisce pi&ugrave; o meno lentamente verso la fibrosi e la cirrosi. Inoltre, &egrave; spesso associata a un aumentato rischio di malattia cardiovascolare e diabete mellito di tipo 2. Negli ultimi anni si sta valutando attentamente quanti pazienti affetti dall&rsquo;epatopatia cronica possano andare incontro all&#39; epatocarcinoma, senza necessariamente avere una cirrosi, legata ai virus dell&rsquo;epatite virale C.</p>\r\n', 'en'),
(95, 48, '<p>La maggior parte dei pazienti con NAFLD &egrave; asintomatica, o presenta una sintomatologia sfumata. Spesso la diagnosi &egrave; occasionale dopo un controllo generale (esami del sangue, ecografia). Alcuni pazienti riferiscono un senso di malessere, stanchezza o una vaga sensazione di dolenzia a livello del quadrante addominale destro (vedi la sede del dolore nell&rsquo;immagine), difficolt&agrave; digestiva. Si pu&ograve; riscontrare epatomegalia e sovrappeso.</p>\r\n\r\n<p><img class="img-responsive" src="http://placehold.it/750x350" /></p>\r\n', 'it'),
(96, 48, '<p>La maggior parte dei pazienti con NAFLD &egrave; asintomatica, o presenta una sintomatologia sfumata. Spesso la diagnosi &egrave; occasionale dopo un controllo generale (esami del sangue, ecografia). Alcuni pazienti riferiscono un senso di malessere, stanchezza o una vaga sensazione di dolenzia a livello del quadrante addominale destro (vedi la sede del dolore nell&rsquo;immagine), difficolt&agrave; digestiva. Si pu&ograve; riscontrare epatomegalia e sovrappeso.</p>\r\n\r\n<p><img class="img-responsive" src="http://placehold.it/750x350" /></p>\r\n', 'en'),
(97, 49, '<p>Gli esami clinici che ci devono far sospettare una steatosi o una steatoepatite sono l&#39;iperinsulinemia e l&rsquo;ipertransaminasemia. Un aumento dell&rsquo;alanina aminotransferasi (ALT o GPT) e/o dell&rsquo;aspartato aminotransferasi (AST o GOT) sono gli esami pi&ugrave; frequentemente alterati. Va tuttavia segnalato che alcuni soggetti possono presentare dei valori di AST e ALT normali pur in presenza di NAFLD. Le transaminasi sono degli enzimi contenuti nelle cellule del fegato, che di fatto vengono &ldquo;liberati&rdquo; quando queste subiscono un danno, causandone l&rsquo;aumento dei livelli nel sangue. Generalmente i valori delle transaminasi non sono molto aumentati nella steatosi e sono appena al di sopra della norma. Inoltre, &egrave; frequente un&rsquo;alterazione anche di altri enzimi epatici: fosfatasi alcalina (ALP) e gamma-glutamil transpeptidasi (GGT). Spesso pu&ograve; essere anche associato un incremento dei livelli di ferritinemia (che in genere indica la presenza di infiammazione). Se da un lato questi sono gli esami che valutano in modo diretto un&rsquo;eventuale sofferenza del fegato, dall&rsquo;altro &egrave; frequente riscontrare anche un aumento degli esami che correlano con il metabolismo dei grassi e degli zuccheri (&egrave; frequente infatti rilevare un aumento di trigliceridi e colesterolo, della glicemia e dei livelli di insulina basale ad indicare un quadro di insulino resistenza). L&rsquo;ecografia rappresenta nella pratica clinica quotidiana un esame di primo livello per lo studio delle malattie del fegato e dell&rsquo;apparato biliare; essa &egrave; di facile esecuzione, basso costo, non invasiva, ripetibile, e in mani affidabili, costituisce un indispensabile strumento di diagnosi. Nella diagnostica della steatosi essa rappresenta la pietra miliare; il reperto caratteristico &egrave; quello del cosiddetto fegato brillante.</p>\r\n', 'it'),
(98, 49, '<p>Gli esami clinici che ci devono far sospettare una steatosi o una steatoepatite sono l&#39;iperinsulinemia e l&rsquo;ipertransaminasemia. Un aumento dell&rsquo;alanina aminotransferasi (ALT o GPT) e/o dell&rsquo;aspartato aminotransferasi (AST o GOT) sono gli esami pi&ugrave; frequentemente alterati. Va tuttavia segnalato che alcuni soggetti possono presentare dei valori di AST e ALT normali pur in presenza di NAFLD. Le transaminasi sono degli enzimi contenuti nelle cellule del fegato, che di fatto vengono &ldquo;liberati&rdquo; quando queste subiscono un danno, causandone l&rsquo;aumento dei livelli nel sangue. Generalmente i valori delle transaminasi non sono molto aumentati nella steatosi e sono appena al di sopra della norma. Inoltre, &egrave; frequente un&rsquo;alterazione anche di altri enzimi epatici: fosfatasi alcalina (ALP) e gamma-glutamil transpeptidasi (GGT). Spesso pu&ograve; essere anche associato un incremento dei livelli di ferritinemia (che in genere indica la presenza di infiammazione). Se da un lato questi sono gli esami che valutano in modo diretto un&rsquo;eventuale sofferenza del fegato, dall&rsquo;altro &egrave; frequente riscontrare anche un aumento degli esami che correlano con il metabolismo dei grassi e degli zuccheri (&egrave; frequente infatti rilevare un aumento di trigliceridi e colesterolo, della glicemia e dei livelli di insulina basale ad indicare un quadro di insulino resistenza). L&rsquo;ecografia rappresenta nella pratica clinica quotidiana un esame di primo livello per lo studio delle malattie del fegato e dell&rsquo;apparato biliare; essa &egrave; di facile esecuzione, basso costo, non invasiva, ripetibile, e in mani affidabili, costituisce un indispensabile strumento di diagnosi. Nella diagnostica della steatosi essa rappresenta la pietra miliare; il reperto caratteristico &egrave; quello del cosiddetto fegato brillante.</p>\r\n', 'en'),
(99, 50, '<p>Da sempre si &egrave; cercato di ottenere informazioni sullo stato funzionale e sull&#39; architettura del fegato utilizzando le informazioni derivate da indagini non invasive (ad es. l&rsquo;ecografia e gli esami del sangue), tuttavia al momento nessun test ematico da solo &egrave; in grado di dare una risposta completa. Negli ultimi anni si &egrave; cercato di ovviare a questo problema studiando la possibile combinazione di dati generali del paziente al fine di ottenere una risposta &ldquo;indiretta&rdquo;. Di recente, nella pratica clinica sono stati introdotti alcuni biomarcatori che potrebbero aiutare a selezionare i pazienti con epatopatia iniziale o cronica. FIBROTEST Rappresenta la combinazione di marcatori indiretti pi&ugrave; studiata finora, prevede la combinazione di esami del sangue quali GGT, bilirubina totale, aptoglobina, &alpha;1 e &alpha;2 macroglobulina. Fibrotest pu&ograve; essere utilizzato per pazienti con epatite virale, alcolica o metabolica per la valutazione del danno epatico. Permette di classificare i pazienti per stadio oltre a determinare l&rsquo;attivit&agrave; necroinfiammatoria virale. FIBROMAX Il FibroMax fornisce informazioni sul grado di steatosi, flogosi e fibrosi. Questo test utilizza un sistema basato su alcuni parametri del paziente come sesso, et&agrave;, peso, altezza e alcuni esami del sangue (&alpha;2macroglobulina, aptoglobulina, apolipoproteina A1, bilirubina totale, AST, ALT, GGT, glicemia a digiuno, trigliceridi e colesterolo totale). Come per il Fibrotest pu&ograve; essere utilizzato per pazienti con epatite virale, alcolica o metabolica per la valutazione del danno epatico. Negli studi condotti finora, per valutare l&rsquo;efficacia di questi test, si evidenziano dei dati incoraggianti, utili per lo screening della fibrosi avanzata o della NASH in pazienti con sindrome metabolica. FIBROSCAN E&rsquo; una tecnica che &egrave; stata sviluppata di recente per la valutazione della fibrosi epatica, viene anche chiamata elastografia transitoria. Permette di valutare la rigidit&agrave; del fegato con uno strumento che &egrave; simile ad un ecografo, secondo il presupposto che il tessuto del fegato, quando va in contro alla fibrosi diventa pi&ugrave; &ldquo;duro&rdquo;. L&rsquo;esame si esegue mediante una sonda che, appoggiata tra gli spazi intercostali al di sopra del fegato, invia un piccolo impulso ad onda meccanica alla cute e ne registra il tempo di &ldquo;ritorno&rdquo;: con tale metodica lo strumento riesce a registrare la velocit&agrave; di propagazione delle onde e stabilire quindi la rigidit&agrave; del fegato.</p>\r\n\r\n<p><img class="img-responsive" src="http://placehold.it/750x350" /></p>\r\n', 'it'),
(100, 50, '<p>Da sempre si &egrave; cercato di ottenere informazioni sullo stato funzionale e sull&#39; architettura del fegato utilizzando le informazioni derivate da indagini non invasive (ad es. l&rsquo;ecografia e gli esami del sangue), tuttavia al momento nessun test ematico da solo &egrave; in grado di dare una risposta completa. Negli ultimi anni si &egrave; cercato di ovviare a questo problema studiando la possibile combinazione di dati generali del paziente al fine di ottenere una risposta &ldquo;indiretta&rdquo;. Di recente, nella pratica clinica sono stati introdotti alcuni biomarcatori che potrebbero aiutare a selezionare i pazienti con epatopatia iniziale o cronica. FIBROTEST Rappresenta la combinazione di marcatori indiretti pi&ugrave; studiata finora, prevede la combinazione di esami del sangue quali GGT, bilirubina totale, aptoglobina, &alpha;1 e &alpha;2 macroglobulina. Fibrotest pu&ograve; essere utilizzato per pazienti con epatite virale, alcolica o metabolica per la valutazione del danno epatico. Permette di classificare i pazienti per stadio oltre a determinare l&rsquo;attivit&agrave; necroinfiammatoria virale. FIBROMAX Il FibroMax fornisce informazioni sul grado di steatosi, flogosi e fibrosi. Questo test utilizza un sistema basato su alcuni parametri del paziente come sesso, et&agrave;, peso, altezza e alcuni esami del sangue (&alpha;2macroglobulina, aptoglobulina, apolipoproteina A1, bilirubina totale, AST, ALT, GGT, glicemia a digiuno, trigliceridi e colesterolo totale). Come per il Fibrotest pu&ograve; essere utilizzato per pazienti con epatite virale, alcolica o metabolica per la valutazione del danno epatico. Negli studi condotti finora, per valutare l&rsquo;efficacia di questi test, si evidenziano dei dati incoraggianti, utili per lo screening della fibrosi avanzata o della NASH in pazienti con sindrome metabolica. FIBROSCAN E&rsquo; una tecnica che &egrave; stata sviluppata di recente per la valutazione della fibrosi epatica, viene anche chiamata elastografia transitoria. Permette di valutare la rigidit&agrave; del fegato con uno strumento che &egrave; simile ad un ecografo, secondo il presupposto che il tessuto del fegato, quando va in contro alla fibrosi diventa pi&ugrave; &ldquo;duro&rdquo;. L&rsquo;esame si esegue mediante una sonda che, appoggiata tra gli spazi intercostali al di sopra del fegato, invia un piccolo impulso ad onda meccanica alla cute e ne registra il tempo di &ldquo;ritorno&rdquo;: con tale metodica lo strumento riesce a registrare la velocit&agrave; di propagazione delle onde e stabilire quindi la rigidit&agrave; del fegato.</p>\r\n\r\n<p><img class="img-responsive" src="http://placehold.it/750x350" /></p>\r\n', 'en'),
(101, 51, '<p>Non esiste ad oggi una terapia standardizzata della NAFLD. Modificare il proprio stile di vita &egrave; fondamentale per una significativa riduzione della steatosi e una normalizzazione degli esami clinici. L&rsquo;utilizzo di integratori antiossidanti &egrave; utile per prevenire l&rsquo;evoluzione del danno, recuperare la funzionalit&agrave; epatica, riequilibrare il metabolismo. RealSIL, un integratore, a base di silibina con fosfolipidi e vitamina E, protegge gli epatociti dal danno infiammatorio dei radicali liberi, come stabilizzatore di membrana e antiossidante naturale, ed &egrave; in grado di &ldquo;depurare il fegato grasso&rdquo; e rallentarne il danno, riequilibrando l&rsquo;assetto metabolico, alla base dell&rsquo;accumulo di grassi nel fegato. Dagli studi fatti con RealSIL si &egrave; visto che il prodotto normalizza gli indici di funzionalit&agrave; epatica (ALT e YGT), riduce il grado di steatosi epatica, contrasta l&rsquo;infiammazione epatica e sistemica, riduce l&rsquo;iperglicemia e migliora la sensibilit&agrave; all&rsquo;insulina. I risultati uno studio randomizzato in doppio cieco multicentrico finalizzato a dimostrare l&rsquo;attivit&agrave; di questo integratore sono molto incoraggianti e indicano come le sostanze che lo compongono possano essere in grado di agire sulla malattia. Va inoltre sottolineata l&rsquo;ottima tollerabilit&agrave; e compliance per i pazienti, anche per dosaggi elevati e per lunghi periodi. Link utili Studio 1: complesso di vitamina E, silibina, fosfolipidi e riduzione danno epatico Studio 2: complesso di vitamina E, silibina, fosfolipidi ed effetto antifibrotico Fegato grasso: patologia, diagnosi, terapia In passato sono stati proposti diversi farmaci, insulino-sensibilizzanti, ipolipemizzanti, citoprotettori, antinfiammatori, vitamine. Tutti questi prodotti hanno dimostrato dei limiti nel loro utilizzo nella patologia cronica del fegato, per inefficacia, effetti indesiderati o altre problematiche relative ad un assunzione cronica o con dosaggi elevati. La dieta e l&rsquo;attivit&agrave; fisica sono alla base di un corretto approccio per la NAFLD e l&rsquo;assunzione di qualsiasi prodotto &egrave; secondaria alla modifica dello stile di vita e deve essere mirata ai fattori che innescano il danno epatico cronico.</p>\r\n', 'it');
