(102, 51, '<p>Non esiste ad oggi una terapia standardizzata della NAFLD. Modificare il proprio stile di vita &egrave; fondamentale per una significativa riduzione della steatosi e una normalizzazione degli esami clinici. L&rsquo;utilizzo di integratori antiossidanti &egrave; utile per prevenire l&rsquo;evoluzione del danno, recuperare la funzionalit&agrave; epatica, riequilibrare il metabolismo. RealSIL, un integratore, a base di silibina con fosfolipidi e vitamina E, protegge gli epatociti dal danno infiammatorio dei radicali liberi, come stabilizzatore di membrana e antiossidante naturale, ed &egrave; in grado di &ldquo;depurare il fegato grasso&rdquo; e rallentarne il danno, riequilibrando l&rsquo;assetto metabolico, alla base dell&rsquo;accumulo di grassi nel fegato. Dagli studi fatti con RealSIL si &egrave; visto che il prodotto normalizza gli indici di funzionalit&agrave; epatica (ALT e YGT), riduce il grado di steatosi epatica, contrasta l&rsquo;infiammazione epatica e sistemica, riduce l&rsquo;iperglicemia e migliora la sensibilit&agrave; all&rsquo;insulina. I risultati uno studio randomizzato in doppio cieco multicentrico finalizzato a dimostrare l&rsquo;attivit&agrave; di questo integratore sono molto incoraggianti e indicano come le sostanze che lo compongono possano essere in grado di agire sulla malattia. Va inoltre sottolineata l&rsquo;ottima tollerabilit&agrave; e compliance per i pazienti, anche per dosaggi elevati e per lunghi periodi. Link utili Studio 1: complesso di vitamina E, silibina, fosfolipidi e riduzione danno epatico Studio 2: complesso di vitamina E, silibina, fosfolipidi ed effetto antifibrotico Fegato grasso: patologia, diagnosi, terapia In passato sono stati proposti diversi farmaci, insulino-sensibilizzanti, ipolipemizzanti, citoprotettori, antinfiammatori, vitamine. Tutti questi prodotti hanno dimostrato dei limiti nel loro utilizzo nella patologia cronica del fegato, per inefficacia, effetti indesiderati o altre problematiche relative ad un assunzione cronica o con dosaggi elevati. La dieta e l&rsquo;attivit&agrave; fisica sono alla base di un corretto approccio per la NAFLD e l&rsquo;assunzione di qualsiasi prodotto &egrave; secondaria alla modifica dello stile di vita e deve essere mirata ai fattori che innescano il danno epatico cronico.</p>\r\n', 'en'),
(103, 52, '<p>Grazie ai continui investimenti per il rinnovo dei reparti produttivi e l&rsquo;uso di metodiche originali di sintesi brevettate, Ibi mantiene la sua competitivit&agrave; nel panorama internazionale garantendo alti standard qualitativi dei suoi prodotti.<br />\r\n<br />\r\nIbi produce tutta la gamma delle penicilline sterili con Certificati di Conformit&agrave; in osservanza alle direttive della Farmacopea Europea. Le produzioni dedicate alle penicilline sterili lavorano in condizioni di current Good Manufacturing Procedures (cGMP) e sono approvate dalle Autorit&agrave; Sanitarie pi&ugrave; esigenti.<br />\r\n<br />\r\nLa produzione Ibi &egrave; certificata da US FDA (Food and Drug Administration), Australian TGA (Therapeutic Goods Administration), UK MHRA (Medicines and Healthcare products regulatory agency), AIFA (Agenzia Italiana del Farmaco).</p>\r\n', 'it'),
(104, 52, '<p>Grazie ai continui investimenti per il rinnovo dei reparti produttivi e l&rsquo;uso di metodiche originali di sintesi brevettate, Ibi mantiene la sua competitivit&agrave; nel panorama internazionale garantendo alti standard qualitativi dei suoi prodotti.<br />\r\n<br />\r\nIbi produce tutta la gamma delle penicilline sterili con Certificati di Conformit&agrave; in osservanza alle direttive della Farmacopea Europea. Le produzioni dedicate alle penicilline sterili lavorano in condizioni di current Good Manufacturing Procedures (cGMP) e sono approvate dalle Autorit&agrave; Sanitarie pi&ugrave; esigenti.<br />\r\n<br />\r\nLa produzione Ibi &egrave; certificata da US FDA (Food and Drug Administration), Australian TGA (Therapeutic Goods Administration), UK MHRA (Medicines and Healthcare products regulatory agency), AIFA (Agenzia Italiana del Farmaco).</p>\r\n', 'en'),
(105, 53, '<p><strong>Strumentazione per forme solide orali:</strong></p>\r\n\r\n<ul>\r\n	<li>Granulazione a Letto fluido&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; fino a 100 kg /lotto</li>\r\n	<li>Granulazione a umido fino a 500 kg/lotto</li>\r\n	<li>Comprimitrice &nbsp;fino a 80.000 cpr/h</li>\r\n	<li>Opercolatrice per capsule fino a 45.000 cps/h</li>\r\n	<li>Bassina per rivestimento compresse</li>\r\n	<li>Macchina di riempimento liquidi</li>\r\n</ul>\r\n\r\n<p><strong>Strumentazione per formulazioni iniettabili:</strong></p>\r\n\r\n<ul>\r\n	<li>Macchina di dosaggio in Classe A con sistema di contenimento c-RABS per il riempimento di Vials e fiale siringa e per la produzione&nbsp;<i>in asepsi</i>&nbsp;mediante filtrazione sterilizzante su filtri da 0.22 micron, fino a 7000 pezzi/ora</li>\r\n	<li>La macchina &egrave; alimentata da reattori di dissoluzione in acciaio, termostatabili e inertizzabili, da 20 a 400 L posizionati in area classificata (C) per il compounding delle formulazioni. Possono essere gestiti anche sistemi di preparazione&nbsp;<i>disposable</i>&nbsp;per ridurre possibilit&agrave; di&nbsp;<i>cross-contamination</i>&nbsp;e minimizzare attivit&agrave; di&nbsp;<i>cleaning</i>.</li>\r\n	<li>Sono macchinabili formati di vials da 2 a 100 ml e Fiale Siringhe da 0.5 a 10 ml. E&rsquo; possibile comunque &rdquo;<i>customizzare</i>&rdquo; il dosaggio con formati diversi in funzione di eventuali richieste specifiche.</li>\r\n	<li>Liostato con superficie da 4 mq e sistema di raffredamento a doppio stadio, per la produzione di polveri per soluzioni iniettabili in vials con formato da 2 ml (fino a 10000 vial/lotto) a 25 ml (fino a 2500 vials/lotto)</li>\r\n	<li>Il reparto &egrave; dotato inoltre di una Macchina di dosaggio appositamente dedicata e autorizzata per&nbsp;<i>filling</i>di vials destinati allla sperimentazione clinica (Fase I e II). Tale macchina pu&ograve; gestire in GMP lotti anche estremamente ridotti (da 100-1000 pezzi), ove il valore aggiunto e la disponibilit&agrave; degli API costituiscono un limite critico per le attivit&agrave; di convalida.</li>\r\n	<li>Autoclave per sterilizzazione terminale di formulazioni termostabili.</li>\r\n</ul>\r\n\r\n<p><strong>L&rsquo;iter di sviluppo formulativo &egrave; supportato da una dotazione di strumentazione analitica moderna ed efficiente quale:</strong></p>\r\n\r\n<ul>\r\n	<li>HPLC/UPLC</li>\r\n	<li>GC</li>\r\n	<li>UV-VIS</li>\r\n	<li>Titolazione potenziometrica/Coulometrica</li>\r\n	<li>Osmometria</li>\r\n	<li>DSC</li>\r\n	<li><i>Particle Size e Zeta potential analyzer</i>&nbsp;mediante Light Scattering</li>\r\n	<li>Elettroforesi Capillare</li>\r\n	<li>Western Blotting</li>\r\n</ul>\r\n', 'it'),
(106, 53, '<p><strong><strong>Solid oral dosage forms</strong>:</strong></p>\r\n\r\n<ul>\r\n	<li>Fluid bed granulation&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; up to 100 kg /batch</li>\r\n	<li>Wet Granulation&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; up to 500 kg/batch</li>\r\n	<li>Tablet machine&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; up to 80.000 tb/h</li>\r\n	<li>Capsule machine&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; up to 45.000 cps/h</li>\r\n	<li>Tablets Coating machine</li>\r\n	<li>Liquids filling machine</li>\r\n</ul>\r\n\r\n<p><strong><strong>Injectabl</strong><strong>e formulations:</strong><strong><i></i></strong></strong></p>\r\n\r\n<ul>\r\n	<li><strong>Filling machine</strong> in class &ldquo;A&rdquo; operating with c-RABS system for the filling of vials and pre-filled syringes and the production of sterile formulation by sterile filtration through 0.22 &micro;m filters.\r\n\r\n	<ul>\r\n		<li>The machine is connected to preparation reactors from 20 to 400 L volume, placed in class &ldquo;C&rdquo; area, which can be thermostated and Nitrogen inertized. If necessary, to prevent cross contamination or to solve cleaning issues, disposable equipment can be connected to the filling machine as well.</li>\r\n		<li>The filling machine can work vials from 2 to 100 ml and pre-filled syringes from 0.5 to 10 ml. It is also possible to customize the dosage on the basis of specific requests.</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>Freeze-drier</strong> 4 sqm surface with double stage cooling system for the manufacturing of powders for injection in vial from 2 ml (up to 10000 vials/batch) to 25 ml (up to 2500 vials/batch)</li>\r\n	<li><strong>Dedicated filling machine</strong> for Phase I and II Clinical studies, which can also produce small batches in c-GMP (from 100 to 1000 vials) where the drug availability and/or cost can have a limiting and critical effect on the validation activity.</li>\r\n	<li><strong>Autoclave</strong> for final sterilization of thermally stable formulations.</li>\r\n</ul>\r\n\r\n<p><strong><strong>Analytical Laboratory Equipment:</strong></strong></p>\r\n\r\n<ul>\r\n	<li>HPLC/UPLC</li>\r\n	<li>GC</li>\r\n	<li>UV-VIS</li>\r\n	<li>Potentiometric/ Coulometric titration</li>\r\n	<li>Osmometry</li>\r\n	<li>DSC</li>\r\n	<li><i>Particle Size e Zeta potential</i> Light Scattering analyzer</li>\r\n	<li>Capillary Electrophoresis</li>\r\n	<li>Western Blotting</li>\r\n</ul>\r\n', 'en'),
