(117, 59, '<p>Lavorare in IBI significa inserirsi in una realt&agrave; imprenditoriale solida e dinamica che associa ad una lunga tradizione storica un forte orientamento al futuro.&nbsp;<br />\r\n<br />\r\nPer vincere le molteplici sfide prefissate, IBI valorizza le risorse umane, investe nella loro formazione ed offre un ambiente di lavoro stimolante e con buone prospettive di crescita. Particolare attenzione &egrave; rivolta ai giovani, studenti, neolaureati, disoccupati/inoccupati, che hanno l&rsquo;opportunit&agrave; di sviluppare il proprio potenziale attraverso l&rsquo;inserimento in stage.</p>\r\n\r\n<h4>Possibilit&agrave; per la tua laurea:</h4>\r\n\r\n<p><img alt="" src="http://ibi.dev/img/lavora-con-noi.jpg" /></p>\r\n\r\n<p>I profili prevalentemente ricercati appartengono alle seguenti aree: tecnico-produttiva (produzione, manutenzione, laboratori controllo qualit&agrave;), medico scientifica, ricerca e sviluppo, marketing e vendite, amministrazione, finanza e controllo, risorse umane, logistica, acquisti, information technology. Entusiasmo, creativit&agrave;, motivazione, spirito di iniziativa e capacit&agrave; di lavorare in team sono le caratteristiche fondamentali che il candidato ideale deve possedere. I canali di reclutamento preferenziali sono le candidature spontanee, i contatti con le Universit&agrave; ed alcune societ&agrave; di selezione specializzate.&nbsp;<br />\r\n<br />\r\nLa Direzione Risorse Umane, in collaborazione con i Responsabili di funzione, cura lo screening dei curricula pervenuti ed effettua diversi colloqui individuali al fine di selezionare la candidatura pi&ugrave; idonea alle esigenze aziendali. La condivisione dei valori aziendali - attenzione alle persone, trasparenza, integrit&agrave; e correttezza nei rapporti, apertura al cambiamento nel rispetto del passato - &egrave; requisito indispensabile per entrare a far parte della squadra IBI ed &egrave; ci&ograve; che la rende riconoscibile all&rsquo;esterno come azienda affidabile ed eticamente responsabile.</p>\r\n', 'it'),
(118, 59, '<p>Lavorare in IBI significa inserirsi in una realt&agrave; imprenditoriale solida e dinamica che associa ad una lunga tradizione storica un forte orientamento al futuro.&nbsp;<br />\r\n<br />\r\nPer vincere le molteplici sfide prefissate, IBI valorizza le risorse umane, investe nella loro formazione ed offre un ambiente di lavoro stimolante e con buone prospettive di crescita. Particolare attenzione &egrave; rivolta ai giovani, studenti, neolaureati, disoccupati/inoccupati, che hanno l&rsquo;opportunit&agrave; di sviluppare il proprio potenziale attraverso l&rsquo;inserimento in stage.</p>\r\n\r\n<h4>Possibilit&agrave; per la tua laurea:</h4>\r\n\r\n<p><img alt="" src="/photos/2/56cdcd614cdf7.jpg" style="height:474px; width:750px" /></p>\r\n\r\n<p>I profili prevalentemente ricercati appartengono alle seguenti aree: tecnico-produttiva (produzione, manutenzione, laboratori controllo qualit&agrave;), medico scientifica, ricerca e sviluppo, marketing e vendite, amministrazione, finanza e controllo, risorse umane, logistica, acquisti, information technology. Entusiasmo, creativit&agrave;, motivazione, spirito di iniziativa e capacit&agrave; di lavorare in team sono le caratteristiche fondamentali che il candidato ideale deve possedere. I canali di reclutamento preferenziali sono le candidature spontanee, i contatti con le Universit&agrave; ed alcune societ&agrave; di selezione specializzate.&nbsp;<br />\r\n<br />\r\nLa Direzione Risorse Umane, in collaborazione con i Responsabili di funzione, cura lo screening dei curricula pervenuti ed effettua diversi colloqui individuali al fine di selezionare la candidatura pi&ugrave; idonea alle esigenze aziendali. La condivisione dei valori aziendali - attenzione alle persone, trasparenza, integrit&agrave; e correttezza nei rapporti, apertura al cambiamento nel rispetto del passato - &egrave; requisito indispensabile per entrare a far parte della squadra IBI ed &egrave; ci&ograve; che la rende riconoscibile all&rsquo;esterno come azienda affidabile ed eticamente responsabile.</p>\r\n', 'en');
