INSERT INTO `news` (`id`, `titolo`, `slug`, `immagine_path`, `descrizione`, `testo`, `active`, `status`, `created_at`, `updated_at`) VALUES
(4, 'INAUGURATO NUOVO SITO PRODUTTIVO : 12MLN DI EURO PER POLO DEDICATO AGLI ANTIBIOTICI', 'inaugurato-nuovo-sito-produttivo-12mln-di-euro-per-polo-dedicato-agli-antibiotici', NULL, 'La nuova struttura √® interamente dedicara alla produzione e al dosaggi di antibiotici e si aggiunge al polo storico di via Fossignano‚Ä¶..', '<p>La nuova struttura &egrave; interamente dedicara alla produzione e al dosaggi di antibiotici e si aggiunge al polo storico di via Fossignano.</p>\r\n\r\n<p>Per maggiori informazioni, consultare il pdf:</p>\r\n\r\n<ul>\r\n	<li><a href="/files/2/56b1eda8cabac.pdf">RS IBI inaugurazione nuovo edificio</a>&nbsp;</li>\r\n</ul>\r\n', '1', NULL, '2016-02-03 17:06:26', '2016-02-04 23:26:45'),
(5, 'JOHANNES KHEVENH√úLLER NEL DIRETTIVO DI UNINDUSTRIA', 'johannes-khevenhuller-nel-direttivo-di-unindustria', NULL, 'Johannes Khevenh√ºller, Amministratore Delegato di Ibi √® stato eletto per un secondo mandato a Presidente della Sezione Farmaceutica e Biomedicali di Unindustria, l‚ÄôUnione degli Industriali e delle imprese di Roma, Frosinone, Latina, Rieti, Viterbo. ', '<p>Johannes Khevenh&uuml;ller, Amministratore Delegato di Ibi &egrave; stato eletto per un secondo mandato a Presidente della Sezione Farmaceutica e Biomedicali di Unindustria, l&rsquo;Unione degli Industriali e delle imprese di Roma, Frosinone, Latina, Rieti, Viterbo. La Sezione Farmaceutica e Biomedicali di Unindustria associa oltre 62 aziende che operano nel settore con circa 11.356 dipendenti.</p>\r\n\r\n<p>Le linee programmatiche illustrate dal Presidente, in continuit&agrave; con il percorso gi&agrave; avviato, prevedono il supporto all&rsquo;elaborazione delle linee strategiche di Unindustria, con un focus particolare allo snellimento delle procedure burocratiche che limitano lo sviluppo, alla partecipazione attiva alle iniziative associative, workshop specifici in tema di &ldquo;change management&rdquo;, &ldquo;supply chain&rdquo; ed altri temi di interesse delle aziende del settore. Le aree di intervento sono articolate nel Farmaceutico in senso stretto, nel biomedicale, con un focus specifico e differenziato per le imprese multinazionali e per le medie e piccole.</p>\r\n\r\n<p>Johannes Khevenh&uuml;ller &egrave; Amministratore Delegato di Ibi-Istituto Biochimico Italiano Giovanni Lorenzini Spa di Latina. La sua carriera professionale inizia nel 1981 in Siemens presso le sedi di Zurigo e Roma in qualit&agrave; di Product Manager della linea Unix. Nel 1994 entra nell&rsquo;azienda di famiglia della moglie Camilla Borghese, l&rsquo;Ibi, dove assume il ruolo di Direttore Commerciale Estero. Dal 2000 &egrave; anche Amministratore Delegato. Il mercato estero riveste un ruolo chiave per l&rsquo;azienda: le esportazioni rappresentano circa il 85% del fatturato.</p>\r\n\r\n<p>Il rinnovato impegno preso, sottolinea l&rsquo;importanza per IBI di essere in primo piano in una squadra che immersa nella realt&agrave; delle imprese del nostro territorio riesce a coglierne le criticit&agrave; e a valorizzarne le occasioni di crescita.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1', NULL, '2016-02-03 17:19:09', '2016-02-04 23:26:35'),
(6, 'Fegato Grasso: perch√® non trascurarlo', 'fegato-grasso-perche-non-trascurarlo', NULL, 'La steatosi epatica non alcolica non √® pi√π considerata una condizione benigna. Gli ultimi studi dimostrano che sar√† la causa principale per il trapianto di fegato entro il prossimo decennio ', '<p>La steatosi epatica non alcolica non &egrave; pi&ugrave; considerata una condizione benigna. Gli ultimi studi dimostrano che sar&agrave; la causa principale per il trapianto di fegato entro il prossimo decennio (Nature Reviews Gastroenterology and Hepatology 2013). In aggiunta una recente meta-analisi della letteratura mostra che i pazienti con fegato grasso sono esposti ad aumento del rischio di mortalit&agrave; per cause epatiche (epatocarcinoma) e cardiovascolari e ad un rischio doppio di diabete (Annals of Medicine, 2011).</p>\r\n\r\n<p>Scopri di pi&ugrave; su <a href="http://www.realsil.it">www.realsil.it</a></p>\r\n', '1', NULL, '2016-02-04 20:14:24', '2016-02-04 23:26:28'),
(7, 'Istituto Biochimico Italiano vince il premio per il miglior poster al Simposio AFI Rimini 2015.', 'istituto-biochimico-italiano-vince-il-premio-per-il-miglior-poster-al-simposio-afi-rimini-2015', NULL, 'Dal 10 al 12 giugno 2015 si √® svolta la 55a edizione del Simposio  AFI (Associazione Farmaceutici Industria dedicato al tema ‚Äú Innovazione e Prospettive del Settore Farmaceutico', '<p>Dal 10 al 12 giugno 2015 si &egrave; svolta la 55a edizione del Simposio&nbsp; AFI (Associazione Farmaceutici Industria dedicato al tema &ldquo; Innovazione e Prospettive del Settore Farmaceutico: Ricerca e Sviluppo, Produzione, Distribuzione e Regolamenti&rdquo;. La IBI quest&rsquo;anno ha partecipato all&rsquo;evento, presentando due poster:</p>\r\n\r\n<ul>\r\n	<li><strong>OPTIMIZATION OF A FLUID BED GRANULATION PROCESS FOR AN ORAL FORMULATION THROUGH THE </strong>&nbsp;<strong>&ldquo;DESIGN OF EXPERIMENT&rdquo; (D.O.E) APPROACH</strong></li>\r\n	<li><strong>PRODUCTION OF AN ORPHAN DRUG FOR PHASE I CLINICAL TRIAL: RECOMBINANT HUMAN BMP4</strong></li>\r\n</ul>\r\n\r\n<p>Entrambi i lavori sono stati molto apprezzati ed il secondo ha ricevuto il premio dalla giuria come miglior poster nell&rsquo;area &ldquo;Ricerca e Sviluppo&rdquo;.</p>\r\n\r\n<ul>\r\n	<li><a href="/files/2/56b36d9676d72.PDF" target="_blank">Attestato AFI</a></li>\r\n	<li><a href="/files/2/56b36dcb24df0.pdf" target="_blank">Poster AFI 2015 IBIFEN</a></li>\r\n	<li><a href="/files/2/56b36df559b09.pdf" target="_blank">Poster AFI 2015</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '1', NULL, '2016-02-04 20:28:06', '2016-02-04 23:26:20'),
(8, 'CPHI WORLDWIDE : vieni a trovarci  presso lo stand 4C10 ‚Äì Barcellona 04-06 Ottobre 2016', 'cphi-worldwide-vieni-a-trovarci-presso-lo-stand-4c10-barcellona-04-06-ottobre-2016', 'news/news_immagine-563b1006a170fcb42c934d8379b9b0fa-cphi madrid 2015 foto 1.jpg', 'CPhI √® il principale evento ¬†dell''industria farmaceutica , appuntamento irrinunciabile per conoscere e confrontarsi con i maggiori professionisti del settore farmaceutico : clienti, partner e fornitori.', '<p>CPhI &egrave; il principale evento &nbsp;dell&#39;industria farmaceutica , appuntamento irrinunciabile per conoscere e confrontarsi con i maggiori professionisti del settore farmaceutico : clienti, partner e fornitori.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Attirando pi&ugrave; di 30.000 visitatori provenienti da oltre 140 paesi, &egrave; per Ibi una grande opportunit&agrave; per incontrare direttamente le aziende farmaceutiche internazionali, &nbsp;consolidare i rapporti con i vecchi partner e cercare nuovi potenziali clienti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Venite a visitarci presso il nostro stand, vi aspettiamo!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Per richiedere un appuntamento non esitare a contattarci : <a href="mailto:info@ibi-lorenzini.com">info@ibi-lorenzini.com</a></p>\r\n', '1', NULL, '2016-02-13 05:00:00', '2016-02-24 20:04:00');
